function binarySearch(arr, value, lower, upper) 
{
    if(upper < lower) {
        return -1;
    }
    else if(upper - lower <= 1) {
        if(value === arr[lower]) {
            return lower;
        }
        else if(value === arr[upper]) {
            return upper;
        }

        return -1;
    }

    let mid = Math.floor((lower + upper) / 2);
    if (arr[mid] === value) {
        return mid;
    } 
    else if (arr[mid] < value) {
        return binarySearch(arr, value, mid, upper);
    } else if (arr[mid] > value) {
        return binarySearch(arr, value, lower, mid);
    } 
    
    return -1;
}

function sendMessageToActiveTab(data)
{
    return new Promise((resolve, reject) => {
        const browserLib = getBrowser();
        browserLib.tabs.query({
            active: true, 
            currentWindow: true
        }, (tabs) => {  
            if(tabs.length <= 0) {
                resolve(false);
                return;
            }

            browserLib.tabs.sendMessage(tabs[0].id, data, () => {
                if(browserLib.runtime.lastError) {
                    reject(browserLib.runtime.lastError.message);
                    return;
                }
            });
        });
    });
}

async function sha256(msg) {
    let encoder = new TextEncoder();
    let data = encoder.encode(msg);
    let buffer = await crypto.subtle.digest('SHA-256', data);
    let byteArray = new Uint8Array(buffer);
    let result = [...byteArray].map(value => {
        const hexCode = value.toString(16);
        const paddedHexCode = hexCode.padStart(2, '0');
        return paddedHexCode;
    }).join('');

    return result;
}

class Lock {
    constructor() {
        this._locked = false;
        this._waiting = [];
    }

    async acquire() {
        while (this._locked) {
            await new Promise(resolve => this._waiting.push(resolve));
        }
        this._locked = true;
    }

    release() {
        this._locked = false;
        if (this._waiting.length > 0) {
            const resolve = this._waiting.shift();
            resolve();
        }
    }
}

