async function signIn(account, password) {

    if (!config_prod.validation.account.exec(account) || !config_prod.validation.password.exec(password)) {
        throw new InvalidAccountPasswordPatternError();
    }

    if (!await api.login(account, password)) {
        await utils.setLicenseInStorage('SNType', 'NoLicense');
        await utils.setLicenseInStorage('LicStatus', 'Restricted');
        await utils.setLicenseInStorage('FeatureToggle', config_prod.featureToggle.NoLicense.Restricted);
        throw new InvalidAccountPasswordError();
    }

    await utils.setLicenseInStorage('Account', account);
    await utils.setLicenseInStorage('IsSignIn', true);
    await utils.setLicenseInStorage('IsLogOut', false);

    return await autoFindSeat();
};

