async function autoFindSeat() {
    let account = (await utils.getLicenseFromStorage()).Account;
    let allLicenses = await api.getLicensesByAccount(account);

    await utils.setLicenseInStorage('SNType', 'NoLicense');
    await utils.setLicenseInStorage('LicStatus', 'Restricted');
    await utils.setLicenseInStorage('FeatureToggle', config_prod.featureToggle.NoLicense.Restricted);
    await utils.setLicenseInStorage('LicTransferFailed', true);
    await utils.setLicenseInStorage('list', allLicenses);

    if (allLicenses.length == 0) {
        await utils.setLicenseInStorage('LicTransferFailed', false);
        await utils.setLicenseInStorage('SNType', 'NoLicense');
        await utils.setLicenseInStorage('LicStatus', 'NoTrial');
        await utils.setLicenseInStorage('FeatureToggle', config_prod.featureToggle.NoLicense.NoTrial);
        
        return {
            result: true,
            licNum: 0
        };
    }

    if (allLicenses.length == 1) {
        try {
            if(allLicenses[0].remainingSeats === 0) {
                throw new OverseatError();
            }

            await setSN(allLicenses[0].serial);
            return {
                result: true,
                licNum: 1,
                LicTransferFailed: false
            };
        } catch (error) {
            UtilCarbonCommon_api.logInfo('autoFindSeat: error = ' + error);
            if (error instanceof OverseatError) {
                return {
                    result: true,
                    licNum: 1,
                    LicTransferFailed: true
                };
            } else {
                throw error;
            }
        }
    }

    if (allLicenses.length > 1) {
        let oldSN = '';
        let oldLicense = await utils.getOldLicenseFromStorage() || {};
        if(typeof(oldLicense.SN) !== "undefined") {
            oldSN = oldLicense.SN;
        }

        if (oldSN && find_default()(allLicenses, { serial: oldSN })) {
            try {
                await setSN(oldSN);
                return {
                    result: true,
                    licNum: 1,
                    LicTransferFailed: false
                };
            } catch (error) { }
        }

        let availableLicenses = filter_default()(allLicenses, (license) => license.remainingSeats > 0);
        if (availableLicenses.length == 0) {
            return {
                result: true,
                licNum: 1,
                LicTransferFailed: true
            };
        } else if (availableLicenses.length == 1) {
            await setSN(availableLicenses[0].serial);
            return {
                result: true,
                licNum: 1,
                LicTransferFailed: false,
                list: availableLicenses
            };
        } else {
            // check number of SSS license. Register SSS SN if there is only one SSS license
            let sssLicense = filter_default()(availableLicenses, (license) => license.type === 'VB_SSS');
            if (sssLicense.length === 1) {
                await setSN(sssLicense[0].serial);
                return {
                    result: true,
                    licNum: 1,
                    LicTransferFailed: false,
                    list: availableLicenses
                };
            }

            return {
                result: true,
                licNum: availableLicenses.length,
                LicTransferFailed: true,
                list: availableLicenses
            };
        }
    }
};

async function setSN(serial) {
    let sku = "";
    let expirationDate = "";
    let type = "";
    let licenseList = (await utils.getLicenseFromStorage()).list;
    if(licenseList) {
        let currentLicense = licenseList.find(item=>item.serial === serial);
        if(currentLicense) {
            if(currentLicense.hasOwnProperty('expirationDate')) {
                expirationDate = currentLicense.expirationDate;
            }
            
            if(currentLicense.hasOwnProperty('sku')) {
                sku = currentLicense.sku;
            }

            if(currentLicense.hasOwnProperty('type')) {
                type = currentLicense.type;
            }
        }
    }

    let account = (await utils.getLicenseFromStorage()).Account;
    let displayName = await getDisplayName(account);
    if(!displayName) {
        await utils.setOldLicenseInStorage('SN', serial);
        await utils.setOldLicenseInStorage('Account', account);
        UtilCarbonCommon_api.logInfo('setSN: No display name');
        throw new NoDisplayNameError();
    }

    let productInfo = UtilProductInfo.getProductInfo();
    let pid = productInfo.pid;
    let vid = productInfo.vid;
    let locale = await utils.getLocale();
    let guid = await utils.getDeviceId(account, sku);

    await api.activateLicnese(
        account,
        serial,
        guid,
        pid,
        vid,
        locale,
        displayName
    );

    await utils.setLicenseInStorage('SN', serial);
    await utils.setLicenseInStorage('GUID', guid);
    await setDisplayName(displayName);
    await utils.setLicenseInStorage('LicTransferFailed', false);
    await utils.setLicenseInStorage('SNType', 'Full');
    await utils.setLicenseInStorage('LicStatus', 'Valid');
    await utils.setLicenseInStorage('FeatureToggle', config_prod.featureToggle.Full.Valid);

    // Update expiration date when SN is set
    if(expirationDate) {
        await utils.setExpirationDate(expirationDate);
    }

    // Set SKU of activated license
    await utils.setLicenseInStorage('SKU', sku);

    // Set type of activated license
    await utils.setLicenseInStorage('Type', type);

    // Set old license information
    await utils.setOldLicenseInStorage('SN', serial);
    await utils.setOldLicenseInStorage('Account', account);
    await utils.setOldLicenseInStorage('GUID', guid);
    
    return {
        result: true
    };

}

