async function checkExpiredDate()
{
    let ret = false;
    try {
        let licenseCache = await utils.getLicenseFromStorage();
        let base64ExpiredDate = licenseCache.xd;
        if(base64ExpiredDate === null || typeof(base64ExpiredDate) === 'undefined') {
            throw new LicenseDataMissedError();
        }

        if(base64ExpiredDate.length > 0) {
            let decryptedExpiredDate = "";
            for(let index in base64ExpiredDate) {
                if(index != 0) {
                    decryptedExpiredDate += '/';
                }
                decryptedExpiredDate += atob(base64ExpiredDate[index]);
            }
            UtilCarbonCommon_api.logInfo('checkExpiredDate: ExpiredDate = ' + decryptedExpiredDate);
            await utils.setLicenseInStorage('ExpirationDate', decryptedExpiredDate);

            let expiredDate = Date.parse(decryptedExpiredDate);
            if(Date.now() < expiredDate) {
                ret = true;
            }
        }
    }
    catch(exception) {
        UtilCarbonCommon_api.logError("checkExpiredDate: exception = " + exception);
        if (exception instanceof LicenseDataMissedError) {
            throw exception;
        }
    }

    return ret;
}

async function getLicenseStatus()
{
    let licenseCache = await utils.getLicenseFromStorage();
    if(!licenseCache.token) {
        UtilCarbonCommon_api.logError('getLicenseStatus: token is missed!');
        UtilTelemetryCollector.addTcEvent(UBM_ID.LICENSE_EC_FAIL_NO_TOKEN, '');
        throw new LicenseDataMissedError();
    }
    else if (!licenseCache.refresh_token) {
        UtilCarbonCommon_api.logError('getLicenseStatus: refresh_token is missed!');
        UtilTelemetryCollector.addTcEvent(UBM_ID.CARBON_License_EC_Fail_No_Refresh_Token_S1, '');
        throw new LicenseDataMissedError();
    }
    else if (!licenseCache.GUID) {
        UtilCarbonCommon_api.logError('getLicenseStatus: guid is missed!');
        UtilTelemetryCollector.addTcEvent(UBM_ID.LICENSE_EC_FAIL_NO_GUID, '');
        throw new LicenseDataMissedError();
    }

    // update token before EC
    let updateTokenRet = await api.updateToken(licenseCache.refresh_token);
    if(updateTokenRet === null) {
        UtilCarbonCommon_api.logError('getLicenseStatus: update token failed!');
        await utils.setLicenseInStorage('refreshTokenExpired', true);
        return false;
    }

    let newToken = updateTokenRet.access_token;
    let newRefreshToken = updateTokenRet.refresh_token;
    await utils.setLicenseInStorage('token', newToken);
    await utils.setLicenseInStorage('refresh_token', newRefreshToken);
    await utils.setLicenseInStorage('refreshTokenExpired', false);

    let productInfo = UtilProductInfo.getProductInfo();
    let pid = productInfo.pid;
    let getLicenseRet = await api.getLicense(licenseCache.SN, licenseCache.GUID, pid, newToken);
    UtilCarbonCommon_api.logInfo('getLicenseStatus: getLicenseRet = ' + JSON.stringify(getLicenseRet));
    if (getLicenseRet && getLicenseRet.retCode) {
        UtilCarbonCommon_api.logInfo(`getLicenseStatus: retCode = ${getLicenseRet.retCode}`);
        let snType = '';
        let licenseStatus = '';
        switch(getLicenseRet.retCode) {
            case 200:
                snType = 'Full';
                UtilCarbonCommon_api.logInfo('getLicenseStatus: remainingDays = ' + getLicenseRet.remainingDays);
                // Carbon do not support grace period
                if(getLicenseRet.remainingDays < 0) {
                    licenseStatus = 'Expired';
                }
                else {
                    licenseStatus = 'Valid';
                }
                break;
            case 210: // license expired and the grace period ends
                snType = 'Full';
                licenseStatus = 'Expired';
                break;
            case 211: // overseat
            case 404: // Not yet activate
            case 410: // invalidate license
                snType = 'NoLicense';
                licenseStatus = 'Restricted';
                break;
        }

        UtilCarbonCommon_api.logInfo('getLicenseStatus: snType = ' + snType + ', licenseStatus = ' + licenseStatus);
        if(snType && licenseStatus) {
            await utils.setLicenseInStorage('SNType', snType);
            await utils.setLicenseInStorage('LicStatus', licenseStatus);
            await utils.setLicenseInStorage('FeatureToggle', utils.getFeatureToggle(snType, licenseStatus));
        }

        if(getLicenseRet.hasOwnProperty('expirationDate')) {
            if(getLicenseRet.expirationDate === null) {
                await utils.setExpirationDate(0);
            }
            else {
                await utils.setExpirationDate(getLicenseRet.expirationDate);
            }
        }

        if(getLicenseRet.hasOwnProperty('remainingDays')) {
            await utils.setLicenseInStorage('RemainingDays', getLicenseRet.remainingDays);
        }

        if(getLicenseRet.hasOwnProperty('displayName')) {
            await setDisplayName(getLicenseRet.displayName);
        }

        if(getLicenseRet.hasOwnProperty('isAutoRenewal')) {
            await utils.setLicenseInStorage('AutoRenew', getLicenseRet.isAutoRenewal);
        }

        // get new serial number
        if(getLicenseRet.hasOwnProperty('serial') && getLicenseRet.serial !== licenseCache.SN) {
            await utils.setLicenseInStorage('SN', getLicenseRet.serial);
        }

        return true;
    }
    else {
        UtilCarbonCommon_api.logInfo('getLicenseStatus failed');
    }

    return false;
}

async function renewToken()
{
    let licenseCache = await utils.getLicenseFromStorage();
    if(!licenseCache || !licenseCache.SNType || !licenseCache.LicStatus) {
        throw new LicenseDataMissedError();
    }
    else if(licenseCache.SNType != 'Trial' && licenseCache.SNType != 'Full') {
        return {
            result: false
        };
    }
    else if(licenseCache.LicStatus !== 'Valid') {
        return {
            result: false
        };
    }
    else if(!licenseCache.token) {
        UtilCarbonCommon_api.logError('renewToken: token is missed!');
        UtilTelemetryCollector.addTcEvent(UBM_ID.LICENSE_EC_FAIL_NO_TOKEN, '');
        throw new LicenseDataMissedError();
    }
    else if (!licenseCache.refresh_token) {
        UtilCarbonCommon_api.logError('renewToken: refresh_token is missed!');
        UtilTelemetryCollector.addTcEvent(UBM_ID.CARBON_License_EC_Fail_No_Refresh_Token_S1, '');
        throw new LicenseDataMissedError();
    }
    else if (!licenseCache.GUID) {
        UtilCarbonCommon_api.logError('renewToken: guid is missed!');
        UtilTelemetryCollector.addTcEvent(UBM_ID.LICENSE_EC_FAIL_NO_GUID, '');
        throw new LicenseDataMissedError();
    }

    let updateTokenRet = await api.updateToken(licenseCache.refresh_token);
    UtilCarbonCommon_api.logInfo('renewToken: updateTokenRet = ' + JSON.stringify(updateTokenRet));
    if(updateTokenRet === null || !updateTokenRet.access_token || !updateTokenRet.refresh_token) {
        await utils.setLicenseInStorage('refreshTokenExpired', true);
        UtilCarbonCommon_api.logError('renewToken: update token failed!');
        return {
            result: false
        };
    }

    let newToken = updateTokenRet.access_token;
    let newRefreshToken = updateTokenRet.refresh_token;
    await utils.setLicenseInStorage('token', newToken);
    await utils.setLicenseInStorage('refresh_token', newRefreshToken);
    await utils.setLicenseInStorage('refreshTokenExpired', false);

    return {
        result: true
    };
}

