async function getAccountTokens(state, code)
{
    const verifierMapKeyName = 'oidc_verifier_map';
    let localStorage = await utils.getLocalStorage();
    let verifierMap = localStorage[verifierMapKeyName] || {};
    if (!verifierMap.hasOwnProperty(state)) {
        return false;
    }

    let verifier = verifierMap[state];
    UtilCarbonCommon_api.logInfo(`getAccountLicense: verifier = ${verifier}`);
    delete verifierMap[state];
    await utils.setLocalStorage(verifierMapKeyName, verifierMap);

    let requestResult = await api.grantAccessToken(code, verifier);
    if (!requestResult || !requestResult.access_token) {
        await utils.setLicenseInStorage('SNType', 'NoLicense');
        await utils.setLicenseInStorage('LicStatus', 'Restricted');
        await utils.setLicenseInStorage('FeatureToggle', config_prod.featureToggle.NoLicense.Restricted);
        throw new InvalidAPITokenError();
    }

    let account = '';
    let ConsumerAccountId = '';
    let ret = false;
    try {
        let decoded_access_token = utils.parseJwtToken(requestResult.access_token);
        if (decoded_access_token.hasOwnProperty('email')) {
            account = decoded_access_token['email'];
        }
        if (decoded_access_token.hasOwnProperty('ConsumerAccountID')) {
            ConsumerAccountId = decoded_access_token['ConsumerAccountID'];
        }

        ret = !!account;
        await utils.setLicenseInStorage('Account', account);
        await utils.setLicenseInStorage('ConsumerAccountId', ConsumerAccountId);
        await utils.setLicenseInStorage('IsSignIn', ret);
        if (ret) {
            await utils.setLicenseInStorage('IsLogOut', false);
        }
    } catch(exception) {
        UtilCarbonCommon_api.logError(`getAccountLicense: exception = ${exception}`);
    }
    UtilCarbonCommon_api.logInfo(`getAccountLicense: account = ${account}`);
    
    return ret;
}

