function handle(action, error, tabId) {
    if(error instanceof InvalidAccountPasswordPatternError) {
        utils.sendMessage({
            action: action,
            data: {
                result: false,   
                error: 'SignIn',
                StatusCode: 1000
            }
        }, tabId);
    } else if (error instanceof InvalidAccountPasswordError) {
        utils.sendMessage({
            action: action,
            data: {
                result: false,   
                error: 'SignIn'
            }
        }, tabId);
    } else if (error instanceof InvalidAPITokenError) {
        if(error.errorCode === '401.00.00') {
            licenseFlow.signOut();
        }
        utils.sendMessage({
            action: action,
            data: {
                result: false,   
                error: 'token_expired'
            }
        }, tabId);
    } else if (error instanceof APIError) {
        utils.sendMessage({
            action: action,
            data: {
                result: false,   
                error: error.status === 500 ? 'Server' : 'Generic',
                StatusCode: error.status
            }
        }, tabId);
    } else if (error instanceof APINetworkError) {
        utils.sendMessage({
            action: action,
            data: {
                result: false,   
                error: 'Network'
            }
        }, tabId);
    } else if (error instanceof LicenseDataMissedError) {
        utils.setLicenseInStorage('refreshTokenExpired', true);
    } else if(error instanceof NoDisplayNameError) {
        utils.sendMessage({
            action: action,
            data: {
                result: false,   
                error: 'NoDisplayName'
            }
        }, tabId);
    } else {
        utils.sendMessage({
            action: action,
            data: {
                result: false,   
                error: 'Generic',
                errorMessage: error
            }
        }, tabId);
    }
}

