async function handleLicenseMessage(message, sender)
{
    UtilCarbonCommon_api.logInfo('handleLicenseMessage: message = ' + JSON.stringify(message));
    const tabId = sender ? (sender.tab ? sender.tab.id : null) : null;
    let resultData = null;
    switch (message.action) {
        case 'signInMyAccount':
            resultData = await messageHandler_signIn(message, tabId);
            break;
        case 'signOutMyAccount':
            resultData = await messageHandler_signOut(message, tabId);
            break;
        case 'autoFindSeat':
            resultData = await messageHandler_autoFindSeat(message, tabId);
            break;
        case 'setSN':
            resultData = await messageHandler_setSN(message, tabId);
            break;
        case 'setDisplayName':
            resultData = await messageHandler_setDisplayName(message, tabId);
            break;
        case 'renewToken':
            resultData = await messageHandler_renewToken(message, tabId);
            break;
        case 'renewRefreshToken':
            resultData = await messageHandler_renewRefreshToken(message, tabId);
            break;
        case 'forceEc':
            resultData = await forceEc(message, tabId);
            break;
        case 'openOidcSignInPage':
            resultData = await openOidcSignInPage(message, tabId);
            break;
        case 'activateAccountLicense':
            resultData = await activateAccountLicense(message, tabId);
            break;
    }

    if(resultData !== null) {
        const response = {
            action: message.action,
            data: resultData
        };

        utils.sendMessage(response, tabId);
    }
}

