    checkExceptionList(url) 
    {
        var ratingAction = "do_rating";
        if(this.wtp.exception) {
            if(this.wtp.exception.permanent && this.wtp.exception.permanent.length > 0) {
                ratingAction = this.getRatingAction(this.wtp.exception.permanent, url);
            }
            if(this.wtp.exception.temporary && this.wtp.exception.temporary.length > 0) {
                ratingAction = this.getRatingAction(this.wtp.exception.temporary, url);
            }
        }
        
        return ratingAction;
    }

    getRatingAction(exceptionList, url)
    {
        var ratingAction = "do_rating";
        for (var i=0; i < exceptionList.length ; i++) {
            var pattern = exceptionList[i].URL.replace(/\*/g, "[^ ]*").replace(/\./g, "\\\.");
            var regex = new RegExp(pattern);
            var match = url.match(regex);
            if (match !== null) {
                if (exceptionList[i].Type === 0) {
                    ratingAction = "by_pass";
                }
                else if (exceptionList[i].Type === 1) {
                    ratingAction = "block";
                }
                break;
            }
        }

        return ratingAction;
    }

