            let isArm = await UtilPlatform.isArm();
            if (isNeedTutorial === PG_NEED_TUTORIAL.ALREADY_IN_PAY_GUARD || this.getMajorVersion() <= 15) {
                this.pg.support = false;
                this.pg.enable = false;

                UtilTelemetryCollector.addTcEvent(constants_UBM_ID.PAY_GUARD_SET_UNSUPPORT, JSON.stringify({
                    'version': this.productInfo.ProductVersion,
                    'isNeedTutorial': isNeedTutorial,
                    'update': true
                }));
            }
            else if (isArm) {
                this.pg.support = false;
                this.pg.enable = false;
            }
            else {
                this.pg.support = true;
            }

            this.pg.initialized = true;

            let titanium = (await AsyncChromeApi.getStorage({
                'titanium': {
                }
            })).titanium;
            if(!titanium.settings) {
                titanium.settings = {};
            }
            titanium.settings.pg = this.pg;
