    RatingUrls(guid, flowID, urls, category, getRealUrl, callback)
    {
        return new Promise(resolve => {
            let urlList = [];
            for (let i = 0; i < urls.length; ++i) {
                let encoded_url = urls[i] ? encodeURI(urls[i]) : urls[i];
                urlList.push(encoded_url);
            }
    
            if (urlList.length === 0) {
                UtilCarbonCommon_api.logInfo(this.tagName, 'No url to rate');
                return true;
            }
            else {
                UtilCarbonCommon_api.logInfo(this.tagName, 'RatingUrls: urlList = ' + JSON.stringify(urlList));
            }

            let param = {
                "DocID": guid, 
                "FlowID": flowID, 
                "UrlList": urlList, 
                "UrlArrLen": urlList.length, 
                "Category": category, 
                "IsEncoded": true,
                "KeepOriginalUrl": !getRealUrl
            };

            if (!this.postMessage("RatingURL", param)) {
                UtilCarbonCommon_api.logError(this.tagName, "RatingURL failed");
                resolve(false);
            }
            else {
                // remove existing record
                if(this.ratingUrlsRecordMap.hasOwnProperty(guid)) {
                    let urlRecord = this.ratingUrlsRecordMap[guid];
                    urlRecord.resolve(true);
                    this.preserveConnectIdSet.delete(urlRecord.resolve);
                    delete this.ratingUrlsRecordMap[guid];
                }

                this.ratingUrlsRecordMap[guid] = {
                    'resolve': resolve,
                    'urls': urlList,
                    'callback': callback
                }
                this.preserveConnectIdSet.add(resolve);
            }
        });
    }

    onRatingUrlsCallback(data) 
    {
        UtilCarbonCommon_api.logInfo(this.tagName, 'onRatingUrlsCallback: data = ' + JSON.stringify(data));
        let url = data.Url;
        if (!url) {
            return;
        }

        let docID = data.DocID;
        let flowID = data.FlowID;
        let resultID = data.ResultID;
        let ratingLevel = data.RetLevel;
        let licenseData = UtilLocalStorageCache.getValue({
            'license': {}
        });

        if (licenseData.license.IsInFreeMode && resultID > 3) {
            UtilCarbonCommon_api.logInfo(this.tagName, 'onRatingUrlsCallback: rating result is limited.');
            ratingLevel = WRS_RATING_LEVEL.Limited;
        }

        if(!this.ratingUrlsRecordMap.hasOwnProperty(docID)) {
            UtilCarbonCommon_api.logError(this.tagName, 'onRatingUrlsCallback: Unknown guid!...docID = ' + docID);
            return;
        }

        let urlRecord = this.ratingUrlsRecordMap[docID];
        urlRecord.callback(docID, flowID, resultID, ratingLevel, url);

        // check and remove rated url from list
        let index = urlRecord.urls.indexOf(url);
        if(index !== -1) {
            urlRecord.urls.splice(index, 1);
        }
        let bHasUnratedUrl = false;
        for(let i = 0; i < urlRecord.urls.length; ++i) {
            if(!!urlRecord.urls[i]) {
                bHasUnratedUrl = true;
                break;
            }
        }
        if(!bHasUnratedUrl) {
            urlRecord.resolve(true);
            this.preserveConnectIdSet.delete(urlRecord.resolve);
            delete this.ratingUrlsRecordMap[docID];
        }

        if (ratingLevel === WRS_RATING_LEVEL.Dangerous) {
            UtilTelemetryCollector.addTcEvent(constants_UBM_ID.RATING_URLS_DANGEROUS, JSON.stringify({
                'category': data.Category.toString()
            }));
        }
    }

