function retryGetPopupInfo(count = 0)
{
    const MAX_COUNT = 5;

    return new Promise(resolve => {
        if(count === MAX_COUNT) {
            resolve('');
            return;
        }

        StatusCtrl_browser.action.getPopup({}, popupInfo => {
            if(popupInfo) {
                resolve(popupInfo);
                return;
            }

            setTimeout(() => {
                retryGetPopupInfo(count+1)
                .then(ret => {
                    resolve(ret);
                })
            }, 500);
        });
    });
}

