async function UpdateStatus()
{
    let newStatus = null;
    if(!_eula || !_licenseInfo) {
        newStatus = {
            wtp_status: false,
            wtp_imagesafesearch_status: false,
            wtp_sal_status: false,
            ads_status: false,
            ps_status: false,
            pg_status: false,
            fb_status: false,
        }
    }
    else if(_carbonMode === CARBON_MODE.PROMOTER) {
        newStatus = getPromoterStatus();
    }
    else if (_carbonMode === CARBON_MODE.COEXIST) {
        newStatus = await getCoexistStatus();
    }
    else if (_carbonMode === CARBON_MODE.STANDALONE) {
        newStatus = getStandaloneStatus();
    }

    const storageData = await AsyncChromeApi.getStorage({
        'serverConfig': {},
        'browser': ''
    });
    if (storageData.serverConfig.hasOwnProperty('StatusCtrl') && storageData.serverConfig['StatusCtrl'].hasOwnProperty(storageData.browser)) {
        let serverStatus = storageData.serverConfig['StatusCtrl'][storageData.browser];
        UtilCarbonCommon_api.logInfo(tagName, "UpdateStatus: serverStatus = " + JSON.stringify(serverStatus));
        newStatus = newStatus || {};
        for (let key in serverStatus) {
            newStatus[key] = serverStatus[key];
        }
    }

    if(newStatus) {
        UtilCarbonCommon_api.logInfo(tagName, "UpdateStatus: newStatus = " + JSON.stringify(newStatus));
        await AsyncChromeApi.setStorage(newStatus);
    }
}

