function isLicenseStatusChanged(oldLicense, newLicense)
{
    if(!newLicense) {
        return false;
    }
    else if(!oldLicense) {
        return true;
    }

    // check LicStatus
    if(newLicense.hasOwnProperty('LicStatus')) {
        if(!oldLicense.hasOwnProperty('LicStatus') || oldLicense['LicStatus'] !== newLicense['LicStatus']) {
            return true;
        }
    }

    // check FeatureToggle
    if(newLicense.hasOwnProperty('FeatureToggle')) {
        if(!oldLicense.hasOwnProperty('FeatureToggle')) {
            return true;
        }

        for(let key in newLicense.FeatureToggle) {
            if(newLicense.FeatureToggle[key] !== oldLicense.FeatureToggle[key]) {
                return true;
            }
        }
    }

    if(newLicense.hasOwnProperty('refreshTokenExpired')) {
        if(!oldLicense.hasOwnProperty('refreshTokenExpired') || newLicense.refreshTokenExpired !== oldLicense.refreshTokenExpired) {
            return true;
        }
    }

    if(newLicense.hasOwnProperty('IsLogOut')) {
        if(!oldLicense.hasOwnProperty('IsLogOut') || newLicense.IsLogOut !== oldLicense.IsLogOut) {
            return true;
        }
    }

    return false;
}

async function feedbackCarbonStatus()
{
    let storageCache = await AsyncChromeApi.getStorage();
    if(!storageCache.framework_status) {
        setTimeout(() => {
            feedbackCarbonStatus();
        }, 5000);
        return;
    }

    let emailDefenderStatus = false;
    let emailDefenderMode = storageCache.fb_mode;
    if (!!storageCache.fb_status) {
        if (emailDefenderMode === FRAUD_BUSTER_MODE.LOCAL) {
            emailDefenderStatus = true;
        }
        else if (emailDefenderMode === FRAUD_BUSTER_MODE.CLOUD) {
            // enumerate storage to check if DCN of email defender is accepteed and status is enable by email account.
            let valueToCheck = [
                'DCN_accepted',
                'FB_enabled'
            ];
            for (let key in storageCache) {
                if (typeof storageCache[key] !== 'object' || storageCache[key] === null || !valueToCheck.every(v => storageCache[key].hasOwnProperty(v))) {
                    continue;
                }

                if (valueToCheck.every(v => !!storageCache[key][v])) {
                    emailDefenderStatus = true;
                    break;
                }
            }
        }
    }

    // get user settings and check if the extension is pinned
    const userSettings = await StatusCtrl_browser.action.getUserSettings();

    UtilTelemetryCollector.addTcEvent(constants_UBM_ID.STATUS_ON_START, {
        'mode': storageCache.mode,
        'wtp': !!storageCache.wtp_status,
        'PageRating': !!storageCache.wtp_pagerating_status,
        'PageRatingHighLight': !!storageCache.wtp_pagerating_highlight_status,
        'PageRatingSetPopupIsSet': !!storageCache.wtp_pagerating_set_popup_is_set,
        'PageRatingSetPopupIsSeen': !!storageCache.wtp_pagerating_set_popup_is_seen,
        'ManualRating': !!storageCache.wtp_manualrating_status,
        'EmailDefender': !!emailDefenderStatus,
        'EmailDefenderMode': emailDefenderMode,
        'AdBlock': !!storageCache.ads_status,
        'PrivacyScanner': !!storageCache.ps_status,
        'PayGuard': !!storageCache.pg_status,
        'SupportPayGuard': !!storageCache.pg_support_status,
        'PumStatus': !!storageCache.pum_status,
        'isPinned': userSettings.isOnToolbar
    });
}

