async function Initialize()
{
    let storageData = await AsyncChromeApi.getStorage({
        'os': '',
        'eula': false,
        'license': null,
        'mode': ''
    });

    _eula = storageData.eula;
    _carbonMode = storageData.mode;
    _licenseInfo = storageData.license;

    StatusCtrl_browser.storage.onChanged.addListener(async changes => {
        let bUpdateStatus = false;

        if('mode' in changes && changes.mode.oldValue !== changes.mode.newValue) {
            _carbonMode = changes.mode.newValue;
            UtilCarbonCommon_api.logInfo(tagName, "carbonMode = " + _carbonMode);
            await setInitialStatus();
            bUpdateStatus = true;
        }
        if('eula' in changes && changes.eula.oldValue !== changes.eula.newValue) {
            _eula = changes.eula.newValue;
            UtilCarbonCommon_api.logInfo(tagName, "eula = " + _eula);
            bUpdateStatus = true;
        }
        if ("license" in changes) {
            _licenseInfo = changes.license.newValue;
            UtilCarbonCommon_api.logInfo(tagName, "licenseInfo = " + JSON.stringify(_licenseInfo));
            if(isLicenseStatusChanged(changes.license.oldValue, changes.license.newValue)) {
                bUpdateStatus = true;
            }
        }
        if ("titanium" in changes) {
            UtilCarbonCommon_api.logInfo(tagName, "titanium = " + JSON.stringify(changes.titanium.newValue));
            bUpdateStatus = true;
        }
        if ("itis" in changes) {
            UtilCarbonCommon_api.logInfo(tagName, "itis = " + JSON.stringify(changes.itis.newValue));
            bUpdateStatus = true;
        }
        if ("popup_style" in changes && changes.popup_style.oldValue !== changes.popup_style.newValue) {
            UtilCarbonCommon_api.logInfo(tagName, "popup_style = " + JSON.stringify(changes.popup_style.newValue));
            if(StatusCtrl_isToolbar() && changes.popup_style.newValue === 'popup') {
                await ResetAdsStatus();
            }
        }
        if ("serverConfig" in changes) {
            let oldServerConfig = JSON.stringify(changes.serverConfig.oldValue);
            let newServerConfig = JSON.stringify(changes.serverConfig.newValue);
            if (oldServerConfig !== newServerConfig) {
                UtilCarbonCommon_api.logInfo(tagName, "serverConfig = " + newServerConfig);
                bUpdateStatus = true;
            }
        }

        if(bUpdateStatus) {
            await UpdateStatus();
        }
    });
}

