let UtilMaven_browser = UtilCarbonCommon_api.getBrowser();

async function postScanApi(ratingUrl)
{
    let currentTime = Math.floor(((new Date()).getTime() / 1000));
    if(!ratingUrl) {
        return null;
    }
    else if(_scanCache.hasOwnProperty(ratingUrl) && currentTime < _scanCache[ratingUrl].expiredTime) {
        return _scanCache[ratingUrl];
    }

    let url = new URL('api/v1/scan/url', UtilMaven_config_prod.url);
    let productInfo = UtilProductInfo.getProductInfo();
    let tiguid = productInfo.tiguid;
    let hashedTiguid = await UtilCarbonCommon_api.sha256(tiguid);
    let browserId = UtilBrowser.getBrowserId();
    let source = browserId === 'msedge' ? 'MsedgeExt' : 'ChromeExt';
    let body = JSON.stringify({
        'service': UtilMaven_config_prod.service,
        'url': ratingUrl,
        'async': false,
        'pid': productInfo.pid,
        'uuid': hashedTiguid,
        'source': source
    });
    let options = {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json;charset=utf-8',
            'Expect-CT': 'max-age=86400, enforce'
        },
        body: body
    };

    let ret = null;
    try {
        let response = await fetch(url.href, options);
        if(response.status === 200) {
            ret = await response.json();
            // Save scan result to cache
            if(ret.status === 'OK' && ret.results[0]) {
                let score = 100 - ret.results[0].rating;
                if(score > 80) {
                    ret.expiredTime = currentTime + DAYS;
                }
                else if(score < 50) {
                    ret.expiredTime = currentTime + 35 * MINUTES;
                }
                else if(score === 71) {
                    ret.expiredTime = currentTime + 5 * MINUTES;
                }
                else {
                    ret.expiredTime = currentTime;
                }
                _scanCache[ratingUrl] = ret;
            }
        }
        else {
            UtilCarbonCommon_api.logError('postScanApi: response.status = ' + response.status);
        }
    }
    catch(exception) {
        UtilCarbonCommon_api.logError('postScanApi: exception = ' + exception);
    }
    
    return ret;
}

async function feedbackLog(filename, encodedData)
{
    let ret = false;
    let uid = esm_browser_v4();
    let statusCode = 0;

    try {
        let header = {
            'Content-Type': 'application/json',
            'Expect-CT': 'max-age=86400, enforce'
        };
        
        let pid = UtilProductInfo.getProductInfo('pid');
        let osInfo = UtilPlatform.detectOsPlatform();
        let manifest = UtilMaven_browser.runtime.getManifest();
        let url = new URL('api/v1/logrepo', UtilMaven_config_prod.url);
        let body = JSON.stringify({
            uid: uid,
            pid: pid,
            version: manifest.version,
            model: osInfo.os,
            osVer: osInfo.osVersion,
            type: "console_log",
            content_name: filename,
            content: encodedData
        });

        let options = {
            method: 'PUT',
            headers: header,
            body: body
        };

        let response = await fetch(url.href, options);
        statusCode = response.status;
        if (statusCode == 200) {
            //alert("Please provide the following infomation to Trend Micro Support: \n\nUser ID : "+uid);
            ret = true;
        }
    }
    catch(exception) {
        //alert("Unable to submit logs");
    }

    return {
        'UID': uid,
        'result': ret,
        'status': statusCode
    }
}

