const utilLogTool_init = async () => {
    let _systemLog = console.log;
    let _systemDebug = console.debug;
    let _systemError = console.error;
    let _currentCarbonMode = '';
    let _collectedLog = '';
    let _browser = UtilCarbonCommon_api.getBrowser();

    async function collectLog()
    {
        if(_collectedLog.length === 0) {
            return;
        }

        let logContent = _collectedLog;
        _collectedLog = '';

        let timestamp = Math.floor(Date.now() / 1000);
        let filename = timestamp.toString();
        let filefullname = filename + '.log';

        let zip = new (jszip_min_default())();
        zip.file(filefullname, logContent);
        let base64Content = await zip.generateAsync({
            'type': 'base64'
        });

        let ret = await UtilMaven.feedbackLog(filename, base64Content);
        if (!ret.result) {
            _collectedLog = logContent + _collectedLog;
        }
        _browser.storage.local.set({
            'debugLog': _collectedLog
        });

        let activeTab = await AsyncChromeApi.getActiveTab();
        if (activeTab !== 0) {
            _browser.tabs.sendMessage(activeTab[0].id, {
                'action': TB_ACTIONS.SHOW_LOG_COLLECTION_RESULT,
                'params': ret
            });
        }
    }

    function logger(msg) 
    {
        const LOG_FILE_SIZE = (1024 * 1024 * 1); // 1 MB

        _collectedLog = _collectedLog + msg + '\n';

        if (_currentCarbonMode === CARBON_MODE.COEXIST) {
            let productHelper = ProductBundle.getProductHelper();
            if (productHelper && productHelper.writeProductDebugLog(_collectedLog)) {
                _collectedLog = '';
            }
        }

        if (_collectedLog.length > LOG_FILE_SIZE) {
            if (_currentCarbonMode === CARBON_MODE.STANDALONE) {
                collectLog();
            }
            else {
                _collectedLog = '';
                _browser.storage.local.set({
                    'debugLog': _collectedLog
                });
            }
        }
        else {
            _browser.storage.local.set({
                'debugLog': _collectedLog
            });
        }
    }

    function enableLogtool(enable) {
        const insertTimestamp = (oldArgs) => {
            // True array copy so we can call .splice()
            let args = Array.prototype.slice.call(oldArgs, 0);

            // Insert the timestamp where it has to be
            let timestamp = '[' + new Date().toLocaleString() + ']';
            args.splice(0, 0, timestamp);

            return args;
        }

        const ArgsToText = (args) => {
            let msg = '';
            for (let i = 0; i < args.length; i++) {
                if (i !== 0) {
                    msg += ' ';
                }

                if (typeof args[i] === 'string') {
                    msg += args[i];
                }
                else {
                    msg += JSON.stringify(args[i]);
                }
            }

            return msg;
        }

        if(enable) {
            console.log = function() {
                let args = insertTimestamp(arguments);
                let msg = ArgsToText(args);
                
                logger(msg);
                _systemLog(msg);
            }
            
            console.debug = function() {
                let args = insertTimestamp(arguments);
                let msg = ArgsToText(args);

                logger(msg);
                _systemDebug(msg);
            }
            
            console.error = function() {
                let args = insertTimestamp(arguments);
                let msg = ArgsToText(args);

                logger(msg);
                _systemError(msg);
            }
        }
        else {
            console.log = function() {
                if(arguments.length === 0) {
                    return;
                }
                
                _systemLog.apply(this, insertTimestamp(arguments));
            }
            console.debug = function() {
                if(arguments.length === 0) {
                    return;
                }

                _systemDebug.apply(this, insertTimestamp(arguments));
            };
            console.error = function() {
                if(arguments.length === 0) {
                    return;
                }

                _systemError.apply(this, insertTimestamp(arguments));
            };
        }
    }

    let storageData = await _browser.storage.local.get({
        'mode': '',
        'debugLog': '',
        'debug': false
    });

    _currentCarbonMode = storageData.mode;
    _collectedLog = storageData.debugLog;
    enableLogtool(storageData.debug);

    _browser.storage.onChanged.addListener((changes) => {
        if ('mode' in changes) {
            _currentCarbonMode = changes.mode.newValue;
        }

        if('debug' in changes && changes.debug.oldValue !== changes.debug.newValue) {
            enableLogtool(changes.debug.newValue);
            if(changes.debug.oldValue) {
                collectLog();
            }
        }
    });
};

