function mappingCateogryFromWrsToTi(category)
{
    let mappedCategory = '';
    if(CategoryTable.CategoryMapping.hasOwnProperty(category)) {
        mappedCategory = CategoryTable.CategoryMapping[category]
    }

    return mappedCategory;
}

function mappingCateogryFromTiToWrs(category)
{
    let mappedCategory = '';
    for(let item in CategoryTable.CategoryMapping) {
        if(category === CategoryTable.CategoryMapping[item]) {
            mappedCategory = item;
            break;
        }
    }

    return mappedCategory;
}


