function checkExceptionList(mode, url)
{
    let ratingAction = "do_rating";
    if (!url) {
        logInfo('checkExceptionList: url is empty');
        return ratingAction;
    }

    if (mode === CARBON_MODE.STANDALONE) {
        for (let i=0; i < _wtpExceptionList.length; i++) {
            let pattern = _wtpExceptionList[i].replace(/\*/g, "[^ ]*").replace(/\./g, "\\\.");
            let regex = new RegExp(pattern);
            let match = url.match(regex);
            if (match!== null) {
                ratingAction = "by_pass";
                break;
            }
        }

        if(ratingAction === "do_rating" && _wtpTempWhitelist.indexOf(url) !== -1) {
            ratingAction = "by_pass";
        }
    }
    else if (mode === CARBON_MODE.COEXIST) {
        ratingAction = ProductBundle.getProductHelper().checkExceptionList(url);
    }
    logInfo(`checkExceptionList: url = ${url}, ratingAction: ${ratingAction}`);

    return ratingAction;
}

