function score_to_level(score)
{
    if(score >= 0 && score <= 50) {
        return WRS_RATING_LEVEL.Dangerous;
    }
    else if (score >= 51 && score <= 65) {
        return WRS_RATING_LEVEL.HighSuspicious;
    }
    else if (score == 71 || score == 101) {
        return WRS_RATING_LEVEL.Untested;
    }
    else if(score >= 66 && score <= 80) {
        return WRS_RATING_LEVEL.Suspicious;
    }

    return WRS_RATING_LEVEL.Safe;
}

function level_to_score(level)
{
    let score = 101
    switch(level) {
        case WRS_RATING_LEVEL.Dangerous:
            score = 1;
            break;
        case WRS_RATING_LEVEL.HighSuspicious:
            score = 51;
            break;
        case WRS_RATING_LEVEL.Untested:
            score = 71;
            break;
        case WRS_RATING_LEVEL.Suspicious:
            score = 66;
            break;
        case WRS_RATING_LEVEL.Safe:
            score = 81;
            break;
    }

    return score;
}

function rating_to_status(score) 
{
    return score_to_level(100 - score);
}

function getUrlRatingExpiredTime(score)
{
    let result = Math.floor(((new Date()).getTime() / 1000));
    if(score > 80) {
        result += DAYS;
    }
    else if(score < 50) {
        result += 35 * MINUTES;
    }
    else if(score === 71) {
        result += 5 * MINUTES;
    }

    return result;
}

function isDangerousUrl(ratingLevel)
{
    return ratingLevel === WRS_RATING_LEVEL.Blocked ||
        ratingLevel === WRS_RATING_LEVEL.Dangerous ||
        ratingLevel === WRS_RATING_LEVEL.Suspicious ||
        ratingLevel === WRS_RATING_LEVEL.HighSuspicious
}

function UpdateWtpScanCount(is_cancel)
{
    var date = new Date();
    var current_date = new Date(date.getUTCFullYear(),date.getUTCMonth(),date.getUTCDate(),0,0,0,0);
    var current_date_string = date.getUTCFullYear()+'-'+date.getUTCMonth()+'-'+date.getUTCDate();
    var blocked_count_start_date = new Date();
    blocked_count_start_date.setUTCDate(current_date.getUTCDate()-30);
    var page_scanned_count_in_30days = 0;
    var blocked_count_in_30days = 0;

    logInfo("[UpdateWtpScanCount] scan_count data : "+JSON.stringify(_wtpScanCount));

    var updatedScanCount = [];
    var dataToday = null;
    for(var i = 0; i < _wtpScanCount.length; ++i) {
        if (_wtpScanCount[i].date === current_date_string) {
            dataToday = _wtpScanCount[i];
            continue;
        }

        var dataString = _wtpScanCount[i].date.split("-");
        var dataDate = new Date(dataString[0],dataString[1],dataString[2],0,0,0,0);
        if (dataDate > blocked_count_start_date) {
            page_scanned_count_in_30days += _wtpScanCount[i].count;
            blocked_count_in_30days += _wtpScanCount[i].blocked;
            updatedScanCount.push(_wtpScanCount[i]);
        }
    }

    if(dataToday === null) {
        dataToday = {
            'date': current_date_string,
            'count': 0,
            'blocked': 0
        };
    }
    dataToday.count++;
    if(is_cancel) {
        dataToday.blocked++;
    }
    page_scanned_count_in_30days += dataToday.count;
    blocked_count_in_30days += dataToday.blocked;
    updatedScanCount.push(dataToday);

    _wtpScanCount = updatedScanCount;
    logInfo("[UpdateWtpScanCount] _wtpScanCount : " + JSON.stringify(_wtpScanCount) + ", total count in 30 days : " + blocked_count_in_30days);
    toolbarBGLib_browser.storage.local.set({
        wtp_scan_count: _wtpScanCount,
        wtp_page_scanned: page_scanned_count_in_30days,
        wtp_page_blocked: blocked_count_in_30days
    });
}

