function fmaUrlScan(url)
{
    return new Promise((resolve) => {
        // check cache
        let currentTime = Math.floor(((new Date()).getTime() / 1000));
        if(_urlRatingCache.hasOwnProperty(url) && currentTime < _urlRatingCache[url].results.expiredTime) {
            resolve({
                result:true,
                data: _urlRatingCache[url]
            });
            return;
        }

        fbAPI.getUrlScan(url, (data) => {
            let ratingScore = data.results.wcs.score;
            let ratingLevel = score_to_level(ratingScore);
            let ratingExpiredTime = getUrlRatingExpiredTime(ratingScore);
            data.results.level = ratingLevel;
            data.results.expiredTime = ratingExpiredTime;
            _urlRatingCache[url] = data;
            resolve({
                result:true,
                data: data
            });
        }, (error) => {
            api_logError('fmaUrlScan: error = ' + error + ', url = ' + url);
            resolve({
                result: false
            });
        });
    });
}

function renewFraudBusterToken()
{
    return new Promise((resolve) => {
        fbAPI.getFBToken(() => {
            resolve(true);
        }, () => {
            resolve(false);
        })
    });
}

async function swiftPageRating(params, mode)
{
    logInfo('swiftPageRating: params =' + JSON.stringify(params));
    if(!params.urls) {
        api_logError('swiftPageRating: There is no urls in params');
        return;
    }

    let docId = params.windowguid;
    let flowid = params.flowid;
    let ratingResult = true;
    let ratingPromiseArray = params.urls.map((url, i) => {
        return new Promise((resolve) => {
            if(!url) {
                resolve(true);
                return;
            }
    
            let ratingAction = checkExceptionList(mode, url);
            if (ratingAction === "by_pass"){
                OnRatingURLCallback(docId, flowid, i, WRS_RATING_LEVEL.Trusted, decodeURI(url));
                resolve(true);
                return;
            }
            else if(ratingAction === "block") {
                OnRatingURLCallback(docId, flowid, i, WRS_RATING_LEVEL.Dangerous, decodeURI(url));
                resolve(true);
                return;
            }

            fmaUrlScan(url).then((scanResult) => {
                if(scanResult && scanResult.result) {
                    OnRatingURLCallback(docId, flowid, i, scanResult.data.results.level, decodeURI(url));
                    resolve(true);
                }
                else {
                    ratingResult = false;
                    resolve(false);
                }
            });
        });
        
    });

    let resultArray = await Promise.all(ratingPromiseArray);
    if(ratingResult) {
        // All page ratings succeed.
        return;
    }

    // Check and renew license token
    let licenseTokenStatus = await license.checkToken();
    if(!licenseTokenStatus) {
        let renewLicenseTokenRet = await license.renewToken();
        if(!renewLicenseTokenRet || !renewLicenseTokenRet.result) {
            api_logError('swiftPageRating: renew license token failed!');
            return;
        }
    }

    // Renew Fraud Buster token
    let renewFbTokenRet = await renewFraudBusterToken();
    if(!renewFbTokenRet) {
        api_logError('swiftPageRating: renew FB token failed!');
        return;
    }

    // Retry failed FMA URL scan
    for (let i in resultArray) {
        if(resultArray[i] || !params.urls[i]) {
            continue;
        }

        let url = params.urls[i];
        fmaUrlScan(url).then((scanResult) => {
            if(scanResult && scanResult.result) {
                OnRatingURLCallback(docId, flowid, i, scanResult.data.results.level, decodeURI(url));
            }
        });
    }
}

async function swiftSingleUrlRating(params, mode)
{
    logInfo('swiftSingleUrlRating: params =' + JSON.stringify(params));
    if(!params.url) {
        api_logError('swiftSingleUrlRating: There is no url in params');
        return;
    }

    let ratingLevel = WRS_RATING_LEVEL.Untested;
    let ratingAction = checkExceptionList(mode, params.url);
    if (ratingAction === "by_pass"){
        ratingLevel = WRS_RATING_LEVEL.Trusted;
    }
    else if(ratingAction === "block") {
        ratingLevel = WRS_RATING_LEVEL.Dangerous;
    }
    else {
        let ratingResult = await fmaUrlScan(params.url);
        if(!ratingResult || !ratingResult.result) {
            // Check and renew license token
            let licenseTokenStatus = await src.checkToken();
            if(!licenseTokenStatus) {
                let renewLicenseTokenRet = await src.renewToken();
                if(!renewLicenseTokenRet || !renewLicenseTokenRet.result) {
                    api_logError('swiftSingleUrlRating: renew license token failed!');
                    licenseTokenStatus = false;
                }
                else {
                    licenseTokenStatus = true;
                }
            }

            if(licenseTokenStatus) {
                // Renew Fraud Buster Token
                let renewFbTokenRet = await renewFraudBusterToken();
                if(!renewFbTokenRet) {
                    api_logError('swiftSingleUrlRating: renew FB token failed!');
                }
                else {
                    // Retry URL scan
                    ratingResult = await fmaUrlScan(url);
                }
            }
        }

        if(ratingResult && ratingResult.result) {
            ratingLevel = score_to_level(ratingResult.data.results.wcs.score);
        }
    }
        
    OnRatingSingleURLCallback(params.windowguid, decodeURI(params.url), ratingLevel);
}

