function openBlockingPage(url, blockingPageUrl, openCount = 0, interval = 500)
{
    const maxRetryOpenCount = 5;

    return new Promise((resolve) => {
        if(openCount >= maxRetryOpenCount) {
            resolve(-1);
            return;
        }

        let ret = false;
        let tabId = -1;
        for(let key in _ratingResultDict) {
            if(_ratingResultDict[key].wtp_blocked_url === url) {
                toolbarBGLib_browser.tabs.update(parseInt(key), {
                    'url': blockingPageUrl
                });
                ret = true;
                tabId = key;
            }
        }
        logInfo('openBlockingPage: openCount = ' + openCount + ', ret = ' + ret);

        if(!ret) {
            setTimeout(() => {
                openBlockingPage(url, blockingPageUrl, openCount+1, interval)
                .then((value) => {
                    resolve(value);
                })
            }, interval);
        }
        else {
            resolve(tabId);
        }
    });
}

function handleTssReportOfJs(url, tiProductName, category, diaType)
{
    const regexScript = /<script.*src="([^"]*)".*script>/g;

    function checkScript(script) {
        let filteredDOM;
        do {
            filteredDOM = regexScript.exec(script)
            if(filteredDOM) {
                let absolutized = new URL(filteredDOM[1], tabs[response.tab].url).href;
                if(absolutized == url) {
                    AsyncChromeApi.getStorage('locale')
                    .then(data => {
                        let l10n = data.locale;
                        let blockingPageUrl = toolbarBGLib_browser.runtime.getURL('TMToolbar\\SALBlockingPage\\index.html?url=' + absolutized + '&locale=' + l10n + '&product_name_ti=' + tiProductName + '&category_group=' + category + '&dia_type=' + diaType + '&script_redirect=' + tabs[response.tab].url);

                        toolbarBGLib_browser.tabs.sendMessage(tabs[response.tab].id,{
                            'action': TB_ACTIONS.SHOW_SALBLOCKINGPAGE,
                            'parameters': {
                                'url': blockingPageUrl
                            }
                        });
                        toolbarBGLib_browser.windows.getCurrent({populate: true}, function(currentWindow) {
                            if (currentWindow.state === 'fullscreen') {
                              toolbarBGLib_browser.windows.update(currentWindow.id, { state: 'normal' });
                            }
                        });
                    });
                    
                    break;
                }
            }
        } while(filteredDOM);
    }

    toolbarBGLib_browser.tabs.query({}, function(tabs) {
        for(let i = 0 ; i < tabs.length ; ++i) {
            toolbarBGLib_browser.tabs.sendMessage(tabs[i].id, {action: "GetScriptsList", tab: i}, function(response) {
                if(!response) {
                    return;
                }
            
                if(typeof(response.head) !== "undefined") {
                    checkScript(response.head);
                }

                if(typeof(response.body) !== "undefined") {
                    checkScript(response.body);
                }
            });
        }
    });

    return true;
}

function checkProcess(processName)
{
    let ret = false;
    let browserId = getBrowserId();
    switch(browserId) {
        case 'msedge':
            if(processName.includes('msedge.exe')) {
                ret = true;
            }
            break;
        case 'chrome':
            if(processName.includes('chrome.exe')) {
                ret = true;
            }
            break;
        default:
            api_logError('checkProcess: unknown browser id');
            break;
    }

    return ret;
}

