async function feedbackRatedHost(category, host)
{
    if (_isFeedbackingRatedHost) {
        setTimeout(feedbackRatedHost, 1000, category, host);
        return;
    }

    _isFeedbackingRatedHost = true;
    const categoryUbmNameTable = {
        '1': 'Unknown',
        '2': 'SearchResult',
        '3': 'WebMail',
        '4': 'SNS',
        '5': 'ManualRating',
        '6': 'End'
    };

    let data = await AsyncChromeApi.getStorage({
        'wtp_rated_url': {}
    });

    // check if carbon rated urls from host and feedback if not yet.
    let isRated = false;
    do {
        if(!data.wtp_rated_url.hasOwnProperty(category)) {
            data.wtp_rated_url[category] = [];
            break;
        }

        if(-1 === data.wtp_rated_url[category].indexOf(host)) {
            break;
        }

        isRated = true;
    } while(false);

    if(!isRated) {
        let ubmEvent = constants_UBM_ID.RATING_URLS;
        let ubmValue = JSON.stringify({
            'entry': categoryUbmNameTable[category],
            'host': host
        });

        UtilTelemetryCollector.addTcEvent(ubmEvent, ubmValue);
        data.wtp_rated_url[category].push(host);
        await AsyncChromeApi.setStorage(data);
    }
    _isFeedbackingRatedHost = false;
}

