async function rateLoadingTab(tab)
{
    let framework_status = UtilLocalStorageCache.getValue('framework_status');
    if (!framework_status) {
        UtilCarbonCommon_api.logInfo(background_tagName, 'rateLoadingTab: carbon is not ready');
        setTimeout(rateLoadingTab, 500, tab);
        return;
    }

    if (!isWtpEnable()) {
        UtilCarbonCommon_api.logInfo(background_tagName, 'rateLoadingTab: wtp is disabled');
        return;
    }

    if (!tab.hasOwnProperty('url') || !tab.hasOwnProperty('id')) {
        UtilCarbonCommon_api.logInfo(background_tagName, 'rateLoadingTab: information missed...tab = ' + JSON.stringify(tab));
        return;
    }

    let url = tab.url;
    let tabId = tab.id;
    let regExp = new RegExp('^(https|http)://', 'i')
    if (!regExp.test(url)) {
        UtilCarbonCommon_api.logInfo(background_tagName, 'rateLoadingTab: url protocal is not support...url = ' + url);
        return;
    }

    await initialTabRatingResult(tabId, url);

    let ratingAction = checkExceptionList(_carbon_mode, url);
    if (ratingAction === 'by_pass') {
        UtilCarbonCommon_api.logInfo(background_tagName, 'rateLoadingTab: In exception list and by pass rating : ' + url);
        await updateTabRatingResult(tabId, WRS_RATING_LEVEL.Trusted, '', 81);
        await updateWtpScanResult(tabId);
    }
    else if (ratingAction === "block") {
        UtilCarbonCommon_api.logInfo(background_tagName, 'rateLoadingTab: Block url by blocking list: ' + url);
        await updateTabRatingResult(tabId, WRS_RATING_LEVEL.Blocked, '', 21);
        await updateWtpScanResult(tabId);
        UtilCarbonCommon_api.logInfo(background_tagName, 'rateLoadingTab: show blocking page');
        background_browser.tabs.update(tabId, {
            'url': background_browser.runtime.getURL("js/wtp/BlockingPage/wtpTemplate.html")
        });
        sendBlockingPageUbm(url);
    }
    else if (ratingAction === "do_rating") {
        UtilCarbonCommon_api.logInfo(background_tagName, 'rateLoadingTab: Start rating url = ' + url);
        if (_carbon_mode === CARBON_MODE.COEXIST) {
            if (UtilPlatform.isWindows()) {
                url = encodeURI(url);
                let helper = ProductBundle.getTitaniumHelper();
                if (helper.wtp.supportBrowsingUrlRating) {
                    let ratingRet = await helper.RatingBrowsingUrl(tabId, url, 0);
                    UtilCarbonCommon_api.logInfo(background_tagName, 'rateLoadingTab: ratingRet = ' + JSON.stringify(ratingRet));
                    if (ratingRet.Url) {
                        OnRatingBrowsingUrlCallback(tabId, url, ratingRet.RetLevel, ratingRet.Score, ratingRet.Category);
                    }
                }
                else {
                    helper.RatingSingleUrl(
                        tabId.toString(), 
                        url, 
                        TCategary.E_CATEGARY_WTP.toString(), 
                        (docID, url, retLevel, bPhishing, category) => {
                            let score = level_to_score(retLevel);
                            OnRatingBrowsingUrlCallback(parseInt(docID), url, retLevel, score, category);
                        }
                    );
                }
            }
            else {
                mavenWtpRating(tabId, encodeURI(url));
                _wtp_maven_rating_data.count++;
                AsyncChromeApi.setStorage({
                    'wtp_maven_rating_data': _wtp_maven_rating_data
                });
            }
        }
        else {
            swiftWtpRating(tabId, encodeURI(url));
        }
    }
}

