async function onSalScan(request, sender)
{
    let result = false;
    do {
        // only Winodws supports SAL
        if (!UtilPlatform.isWindows()) {
            break;
        }

        // only Edge and Chrome support SAL
        let browserId = getBrowserId();
        if ('msedge' !== browserId && 'chrome' !== browserId) {
            break;
        }

        // check if the message is sent from tab
        if (!sender.tab) {
            break;
        }

        let tabId = sender.tab.id;
        if (0 === sender.frameId) {
            // clear URL list of the tab id when request is from main frame meaning that URL is changed.
            await removeTabFromSalScanTabMap(tabId);
        }

        result = true;
        let ratingAction = 'do_rating';
        let params = request.params;
        let url = params.params.url;
        if (checkSalTempExceptionList(url)) {
            ratingAction = 'by_pass';
        }
        else {
            ratingAction = checkExceptionList(_carbon_mode, url);
        }
        UtilCarbonCommon_api.logInfo(background_tagName, 'onSalScan: ratingAction = ' + ratingAction);
        if ('by_pass' === ratingAction) {
            break;
        }

        UtilCarbonCommon_api.logInfo(background_tagName, `onSalScan: do SAL scan for tab ${tabId} with url ${url}`);
        await setSalScanTabId(tabId, url);

        // Do SAL scan through Titanium
        params.params.browser = browserId;
        ProductBundle.getTitaniumHelper().SalScan(params);
    } while(false);

    return result;
}

