async function onFullScreen(windowId)
{
    let tabs = await chrome.tabs.query({
        'windowId': windowId,
        'active': true
    });
    if (tabs.length === 0 || !tabs[0].hasOwnProperty('url')) {
        return;
    }

    let tabId = tabs[0].id;
    let url = encodeURI(tabs[0].url);
    let fnFeedbackUntestedAndFullScreenUrl = () => {
        UtilCarbonCommon_api.logInfo('onFullScreen: feedback untested and fullscreen url');
        UtilTelemetryCollector.addTcEvent(constants_UBM_ID.RATING_URLS_UNTESTED_AND_FULLSCREEN, JSON.stringify({
            'url': url
        }));
    };

    if (_carbon_mode === CARBON_MODE.COEXIST && UtilPlatform.isWindows()) {
        let helper = ProductBundle.getTitaniumHelper();
        if (helper.wtp.supportBrowsingUrlRating) {
            let ratingRet = await helper.RatingBrowsingUrl(tabId, url, 0);
            UtilCarbonCommon_api.logInfo(background_tagName, 'onFullScreen: ratingRet = ' + JSON.stringify(ratingRet));
            if (ratingRet.Url && ratingRet.RetLevel === WRS_RATING_LEVEL.Untested) {
                fnFeedbackUntestedAndFullScreenUrl();
            }
        }
        else {
            helper.RatingSingleUrl(
                tabId.toString(),
                url,
                TCategary.E_CATEGARY_WTP.toString(),
                (docID, url, retLevel, bPhishing, category) => {
                    UtilCarbonCommon_api.logInfo(background_tagName, `onFullScreen: url = ${url}, retLevel = ${retLevel}`);
                    if (retLevel === WRS_RATING_LEVEL.Untested) {
                        fnFeedbackUntestedAndFullScreenUrl();
                    }
                }
            );
        }
    }

    background_browser.tabs.sendMessage(tabId, {
        action: TB_ACTIONS.TAB_STATE_CHANGED_FULLSCREEN
    });
}

