function parseDetectionReport(reportString)
{
    const nthIndex = (str, pat, n) => {
        let L = str.length, i = -1;
        while(n-- && i++ < L) {
            i = str.indexOf(pat, i);
            if (i < 0) {
                break;
            }
        }
        return i;
    }

    let ret = false;
    let jsonReport = null;
    try {
        jsonReport = JSON.parse(reportString);
        ret = true;
    } catch(exception) {
        UtilCarbonCommon_api.logError('parseDetectionReport: exception = ' + exception);
    }

    /*  [TI-11028] [Carbon][EN/JP/ALL][WTP][Func]No SAL/http2 blocking page is displayed for Win7 OS with Carbon NE/C/Chrome Co-exist Mode.
        The format of SAL report might be wrong in some environment.
        Retrieve report from data string as workaround.
    */
    if(!ret || !jsonReport) {
        try {
            let startOfReport = reportString.indexOf('"') - 1;
            let formatFront = reportString[startOfReport] !== '{' ? '{' + reportString.substring(startOfReport + 1) : reportString;
            let paranthesesCount = (formatFront.match(/{/g) || []).length;
            let endOfReport = nthIndex(formatFront, '}', paranthesesCount);
            let formattedReport = formatFront.substring(0, endOfReport + 1);
            jsonReport = JSON.parse(formattedReport);
        } catch(exception) {
            UtilCarbonCommon_api.logError('parseDetectionReport: ' + exception);
        }
    }

    return jsonReport;
}

async function onTssReportCallback(data)
{
    UtilCarbonCommon_api.logInfo('onTssReportCallback: data = ' + JSON.stringify(data));

    let bRet = false;
    try {
        let tssReport = parseDetectionReport(data.dataOut.TSSReport);
        if(tssReport) {
            bRet = await background.handleTssReport(tssReport);
        }
        
        /*
            Check if this is a new series of SAL detection.
            SAL usually sends multiple events of the same URL in a roll.
            blocking page might be already shown and thus extension cannot find the target tab because the URL is changed.
        */
        if(!bRet) {
            let url = tssReport.params.host;
            let prevTssReport = (await AsyncChromeApi.getStorage('tssReport')).tssReport;
            if(typeof(prevTssReport) !== 'undefined' && prevTssReport.params && prevTssReport.params.host !== url) {
                let dataTime = tssReport.params.DataTime;
                let dataProcessPath = tssReport.params.DataProcessPath;
                ProductBundle.getTitaniumHelper().pushBlockingPopup('BEP:102', dataTime, url, dataProcessPath);
            }
        }

        await AsyncChromeApi.setStorage({
            'tssReport': tssReport
        });
    } catch(exception) {
        UtilCarbonCommon_api.logError('onTssReportCallback: exception = ' + exception);
    }
}

