function UpdateAdsScanCount(newBlockCount) 
{
    logInfo(background_moduleName, 'UpdateAdsScanCount: newBlockCount = ' + newBlockCount);

    let date = new Date();
    let current_date = new Date(date.getUTCFullYear(), date.getUTCMonth(), date.getUTCDate(), 0, 0, 0, 0);
    let current_date_string = date.getUTCFullYear() + '-' + date.getUTCMonth() + '-' + date.getUTCDate();
    let blocked_count_start_date = new Date();
    blocked_count_start_date.setUTCDate(current_date.getUTCDate() - 30);
    let blocked_count_in_30days = 0;

    logInfo(background_moduleName, 'UpdateAdsScanCount: _adsScanCount = ' + JSON.stringify(_adsScanCount));

    let dataToday = null;
    let updatedScanCount = [];
    for (let i = 0; i < _adsScanCount.length; i++) {
        if (_adsScanCount[i].date === current_date_string) {
            dataToday = _adsScanCount[i];
            continue;
        }

        let dataString = _adsScanCount[i].date.split("-");
        let dataDate = new Date(dataString[0], dataString[1], dataString[2], 0, 0, 0, 0);
        if (dataDate > blocked_count_start_date) {
            blocked_count_in_30days += _adsScanCount[i].blocked;
            updatedScanCount.push(_adsScanCount[i]);
        }
    }
    if (dataToday === null) {
        dataToday = {
            'date': current_date_string,
            'blocked': 0
        };
    }
    logInfo(background_moduleName, 'UpdateAdsScanCount: dataToday = ' + JSON.stringify(dataToday));
    dataToday.blocked += newBlockCount;
    blocked_count_in_30days += dataToday.blocked;
    updatedScanCount.push(dataToday);

    _adsScanCount = updatedScanCount;
    logInfo(background_moduleName, 'UpdateAdsScanCount: adsScanCount = ' + JSON.stringify(_adsScanCount) + ', total count in 30 days = ' + blocked_count_in_30days);
    adblock_background_browser.storage.local.set({
        'ads_scan_count': _adsScanCount,
        'ads_total_blocked': blocked_count_in_30days
    });
}

