function isInAllowList(url)
{
    if (isHostInExceptionList(url)) {
        logInfo('isInAllowList: url is in exceptional host list');
        return true;
    }
    let storageCache = UtilLocalStorageCache.getValue({
        'ads_whitelist': [],
        'ads_allow_whitelist': []
    });
    if (storageCache.ads_allow_whitelist.includes(url)) {
        logInfo('isInAllowList: url is in temp exception list');
        return true;
    }

    let bIsInExceptionList = false;
    for (let i = 0; i < storageCache.ads_whitelist.length; i++) {
        let pattern = storageCache.ads_whitelist[i].replace(/\*/g, "[^ ]*");
        let regex = new RegExp(pattern);
        let match = url.match(regex);
        if (match !== null) {
            logInfo('isInAllowList: url is in exception list');
            bIsInExceptionList = true;
            break;
        }
    }

    return bIsInExceptionList;
}

