function onBeforeRequestHandler(details)
{
    if (!isAdBlockEnabled()) {
        return { cancel: false };
    }
    else if(!_adsBlockDict.hasOwnProperty(details.tabId)) {
        logInfo(background_moduleName, 'onBeforeRequestHandler: there is no this tab...id = ' + details.tabId);
        return { cancel: false };
    }
    else if (isInAllowList(details.url)) {
        logInfo(background_moduleName, 'onBeforeRequestHandler: Stop doing ad block for ' + details.url);
        return { cancel: false };
    }

    let tabAds = _adsBlockDict[details.tabId];
    let is_cancel_by_ad = false;
    if (!(details.frameId === 0 && details.type === "main_frame")) {
        if (isAdSite(details.url)) {
            is_cancel_by_ad = true;
            logInfo(background_moduleName, 'onBeforeRequestHandler: Block Ad: ' + details.url);
            tabAds.actionCount += 1;
            logInfo(background_moduleName, 'onBeforeRequestHandler: tabId: ' + details.tabId + ', current website blocked: ' + tabAds.actionCount);

            AsyncChromeApi.getCurrentActiveWindowTabId()
                .then(data => {
                    logInfo(background_moduleName, 'onBeforeRequestHandler: getCurrentActiveWindowTabId: data = ' + JSON.stringify(data));
                    logInfo(background_moduleName, `onBeforeRequestHandler: details.tabId = ${details.tabId}, data.tabId = ${data.tabId}`);
                    if (data.ret && data.tabId === details.tabId) {
                        logInfo(background_moduleName, `onBeforeRequestHandler: tabAds = ${JSON.stringify(tabAds)}`);
                        logInfo(background_moduleName, `onBeforeRequestHandler: new ads_on_current_website = ${tabAds.actionCount}`);
                        adblock_background_browser.storage.local.set({
                            'ads_on_current_website': tabAds.actionCount
                        });
                    }

                    UpdateAdsScanCount(1);
                });
        }
    }

    if (is_cancel_by_ad) {
        return { redirectUrl: adblock_background_browser.runtime.getURL("js/adblock/blank.html") };
    }

    return { cancel: false };
}

async function adblock_background_init() 
{
    // Get initial value from local storage.
    let storageData = await AsyncChromeApi.getStorage({
        'ads_scan_count': [],
        'ads_tab_data': _adsBlockDict
    });
    _adsScanCount = storageData.ads_scan_count;

    await getSettings();

    // init BlockDict
    let oldAdsTabData = storageData.ads_tab_data;
    for(let key in oldAdsTabData) {
        let tabId = parseInt(key);
        let tab = await AsyncChromeApi.getTab(tabId);
        if (!tab) {
            continue;
        }

        // Only insert existing tabs
        _adsBlockDict[key] = oldAdsTabData[key];
    }
    let allTabs = await AsyncChromeApi.getTabInfo();
    for (let i = 0; i < allTabs.length; ++i) {
        if (!allTabs[i].hasOwnProperty('id')) {
            continue;
        }

        let tabId = allTabs[i].id;
        if (_adsBlockDict.hasOwnProperty(tabId)) {
            continue;
        }

        _adsBlockDict[tabId] = {
            'url': !!allTabs[i].url ? allTabs[i].url : '',
            'actionCount': 0,
            'tabId': tabId,
            'badgeTextIncrementCount': 0
        };
    
    }
    logInfo(background_moduleName, 'init: _adsBlockDict = ' + JSON.stringify(_adsBlockDict))
    
    if ('firefox' !== getBrowserId()) {
        await adblock_background_browser.declarativeNetRequest.setExtensionActionOptions({
            'displayActionCountAsBadgeText': true
        });
    }
    else {
        adblock_background_browser.webRequest.onBeforeRequest.addListener(onBeforeRequestHandler, { 
            'urls': [
                "http://*/*", 
                "https://*/*"
            ]
        }, [
            'blocking'
        ]);
    }
    
    UtilMessageHandler.runtime.AddHandler('adGetSettings', onAdGetSettings);
    UtilMessageHandler.runtime.AddHandler('adUpdateCount', onAdUpdateCount);
}

