const utils_api_browser = UtilCarbonCommon_api.getBrowser();

class Api {
    constructor() {
        this._toolbarBuildNumber = '';
        this._config = new config();

        this.getToolbarBuildNumber();
    }

    postSecurityScan(payload, callback, reject) {
        const { autoScan, secretData } = payload;
        autoScan.toolbar_build_number = this._toolbarBuildNumber;
        utils_api_browser.storage.local.get({
            mode: '',
            fbLicense: {}
        }, (data) => {
            let token = '';
            let domain = `${this._config.domain}/mail/key/mails`;
            if (false) {} else if (data.mode === 'Standalone') {
                token = data.fbLicense.access_token;
                domain = `${this._config.emailDomain}/mail/token/mails`;
            } else {
                token = Utility.generateToken(secretData);
            }

            const startTime = new Date();
            let endTime;
            let s;
            let code;
            fetch(domain, {
                method: 'POST',
                body: JSON.stringify(autoScan),
                headers: new Headers({
                    'Content-Type': 'application/json',
                    ClientPurpose: this._config.clientPurpose,
                    Authorization: `Bearer ${token}`
                }),
                mode: 'cors'
            }).then((response) => {
                endTime = new Date();
                s = Math.floor((endTime - startTime) / 1000);
                code = response.status;
                if (response.status < 400) {
                    return response.json();
                }
                const error = new Error('Bad response from server');
                error.response = response;
                throw error;
            }).then((responseData) => {
                const newRes = {
                    time: s,
                    token: token,
                    clientPurpose: this._config.clientPurpose,
                    ...responseData
                };
                callback(newRes);
            })
                .catch((error) => error.response.json())
                .then((errorData) => {
                    const newErrorRes = {
                        time: s, token: token, clientPurpose: this._config.clientPurpose, code: code, ...errorData
                    };
                    reject(newErrorRes);
                });
        });
    }

    postUserFeedback(payload, callback, reject) {
        const { feedback, secretData } = payload;
        utils_api_browser.storage.local.get({
            mode: '',
            fbLicense: {},
            fb_mode: FRAUD_BUSTER_MODE.CLOUD
        }, (data) => {
            let token = '';
            let domain = `${this._config.domain}/mail/key/user_feedback`;
            if (data.mode === 'Standalone') {
                token = data.fbLicense.access_token;
                domain = `${this._config.emailDomain}/mail/token/feedback`;
            } else {
                token = Utility.generateToken(secretData);
            }

            switch (data.fb_mode) {
            case FRAUD_BUSTER_MODE.CLOUD:
                feedback.mode = 'cloud';
                break;
            case FRAUD_BUSTER_MODE.LOCAL:
                feedback.mode = 'local';
                break;
            default:
                break;
            }

            const startTime = new Date();
            let endTime;
            let s;
            fetch(domain, {
                method: 'POST',
                body: JSON.stringify(feedback),
                headers: new Headers({
                    'Content-Type': 'application/json',
                    ClientPurpose: this._config.clientPurpose,
                    Authorization: `Bearer ${token}`
                }),
                mode: 'cors'
            }).then((res) => {
                endTime = new Date();
                s = Math.floor((endTime - startTime) / 1000);
                if (res.status < 400) {
                    callback({
                        time: s,
                        feedback: feedback.feedback
                    });
                } else {
                    const error = new Error('Bad response from server');
                    error.code = res.status;
                    error.time = s;
                    error.feedback = feedback.feedback;
                    reject(error);
                }
            }).catch((error) => {
                reject(error);
            });
        });
    }

    getToolbarBuildNumber() {
        fetch('manifest.json', {
            method: 'GET'
        })
            .then((res) => res.json())
            .then((res) => {
                this._toolbarBuildNumber = res.version;
            });
    }

    getFBToken(callback, reject) {
        utils_api_browser.storage.local.get({
            pid: '',
            vid: '',
            tiguid: '',
            license: {}
        }, (data) => {
            if (data.license.token) {
                fetch(`${this._config.authDomain}`, {
                    method: 'POST',
                    body: JSON.stringify({
                        pid: data.pid,
                        vid: data.vid,
                        did: data.tiguid
                    }),
                    headers: new Headers({
                        'Content-Type': 'application/json',
                        Authorization: `Bearer ${data.license.token}`
                    }),
                    mode: 'cors'
                })
                    .then((res) => {
                        if (res.status < 400) {
                            return res.json();
                        }
                        const error = new Error('Bad response from server');
                        error.code = res.status;
                        throw error;
                    }).then((response) => {
                        utils_api_browser.storage.local.set({
                            fbLicense: response
                        });
                        callback(response);
                    }).catch((error) => {
                        reject(error);
                    });
            } else {
                reject('token is undefined');
            }
        });
    }

    getUrlScan(targetUrl, callback, reject) {
        utils_api_browser.storage.local.get({
            fbLicense: null
        }, (data) => {
            if (!data.fbLicense) {
                reject('fbLicense is null');
                return;
            }

            try {
                const queryKey = data.fbLicense.query_key.long_lasting;
                const cacheToken = data.fbLicense.cache_token;
                const productToken = data.fbLicense.product_token;
                const encryptedUrl = Utility.aes256EncryptUrl(queryKey, targetUrl);
                fetch(`${this._config.emailDomain}/scan_url/${encryptedUrl}/${productToken}`, {
                    method: 'GET',
                    headers: new Headers({
                        'X-CacheToken': cacheToken,
                        'Expect-CT': 'max-age=86400, enforce'
                    }),
                    mode: 'cors'
                }).then((res) => {
                    if (res.status < 400) {
                        return res.json();
                    }
                    const error = new Error('Bad response from server');
                    error.code = res.status;
                    throw error;
                }).then((response) => {
                    callback(response);
                }).catch((error) => {
                    reject(error);
                });
            } catch (exception) {
                reject(exception);
            }
        });
    }
}

