function GetPrivacyScannerSettings(items)
{
    for (let i in items) {
        let item = items[i];
        switch (item.key) {
            case 'IsFirstSaveChanges':
                item.value = true;
                break;
            case 'IsFirstFixTwitter':
                item.value = true;
                break;
            case 'IsFirstFixLinkedIn':
                item.value = true;
                break;
            case 'IsConsoleLogEnabled':
                item.value = true;
                break;
            case 'IsFileLogEnabled':
                item.value = false;
                break;
            default:
                UtilCarbonCommon_api.logInfo('GetPrivacyScannerSettings: unknown item key = ' + item.key);
        }
    }
    return items;
};

function ShowPSPage(funid) {
    PSBackgroundWrapper_browser.storage.local.get('urls', function(result) {
        let url = result.urls[funid];
        console.log(url);
        if(url) {
            PSBackgroundWrapper_browser.tabs.create({
                url : url,
                active : true
            });
        }
        else {
            UtilCarbonCommon_api.logError('ShowPSPage: unable to find funid = ' + funid);
        }
    });
};
    
function ShowPSHelpPage() {
    const FUNID = 'ps_help';
    ShowPSPage(FUNID);
};

function ShowPSFAQHelpPage(website, help_id) {
    const FUNID = 'ps_faq';
    ShowPSPage(FUNID);
};

function PrivacyScannerRequestForBrowsers(functionId, strMsg) {
    // Scan/Fix Browser Privacy settings
    return RetryPrivacyScannerRequestForBrowsers(functionId, strMsg, 0, 1000);
};

function RetryPrivacyScannerRequestForBrowsers(functionId, strMsg, count, interval) {
    const maxRetries = 5;

    return new Promise((resolve) => {
        if (count >= maxRetries) {
            resolve('');
            return;
        }

        ProductBundle.getTitaniumHelper().dispatchBrowserPrivacyScanner(functionId, strMsg)
        .then(response => {
            if (!response) {
                setTimeout(() => {
                    RetryPrivacyScannerRequestForBrowsers(functionId, strMsg, count+1, interval)
                    .then((value) => {
                        resolve(value);
                    });
                }, interval);
                return;
            }
            resolve(response);
        });
    });
}

function PrivacyScannerCollectData(msg) {
    try {
        if(!msg || !msg.dataIn || !msg.dataIn.type || !msg.dataIn.data) {
            UtilCarbonCommon_api.logError('PrivacyScannerCollectData: No collected data');
            return;
        }

        if(!UtilTelemetryCollector || !UtilTelemetryCollector.addTcEvent) {
            UtilCarbonCommon_api.logError('PrivacyScannerCollectData: No UtilUbm');
            return;
        }

        UtilTelemetryCollector.addTcEvent(msg.dataIn.type, msg.dataIn.data);

    } catch(exception) {
        UtilCarbonCommon_api.logError('PrivacyScannerCollectData: exception = ' + exception);
    }
}
    
