async function setLanguage()
{
    const response = await fetch(initializator_browser.runtime.getURL("settings.json"));
    const settings = await response.json();
    UtilCarbonCommon_api.logInfo(initializator_tagName, 'setLanguage: support languages ... ' + JSON.stringify(settings.supportLanguage));

    let lang = navigator.language.toLowerCase();
    let currentLocaleSupported = false;
    for (let i = 0; i < settings.supportLanguage.length; ++i) {
        if (settings.supportLanguage[i].toLowerCase().includes(lang)) {
            _locale = settings.supportLanguage[i];
            currentLocaleSupported = true;
            break;
        }
    }
    if (!currentLocaleSupported) {
        _locale = settings.defaultLanguage;
    }
    UtilCarbonCommon_api.logInfo(initializator_tagName, 'setLanguage: locale = ' + _locale);

    if (typeof (settings.l10nFolderMap[_locale]) !== "undefined") {
        _l10n = settings.l10nFolderMap[_locale];
    }
    UtilCarbonCommon_api.logInfo(initializator_tagName, 'setLanguage: l10n = ' + _l10n);

    await AsyncChromeApi.setStorage({
        'locale_n_region': _locale,
        'locale': _l10n
    });
}

