async function connectTitanium()
{
    let tiHelper = ProductBundle.getTitaniumHelper();
    if (!!tiHelper.isConnected) {
        UtilCarbonCommon_api.logInfo("connectTitanium: Titanium is already connected");
        return true;
    }
    let ret = await tiHelper.getProductInformation();
    if(!ret) {
        return false;
    }

    let localStorageCacheData = UtilLocalStorageCache.getValue({
        'mode': '',
        'license': {}
    });
    if(localStorageCacheData.mode !== CARBON_MODE.COEXIST) {
        // save old license
        await AsyncChromeApi.setStorage({
            'old_license': localStorageCacheData.license
        });

        let oldWtpExceptionList = (await AsyncChromeApi.getStorage({
            'wtp_whitelist': []
        })).wtp_whitelist;
        if(oldWtpExceptionList.length !== 0) {
            tiHelper.AddExceptionList(oldWtpExceptionList);
        }
    }

    await AsyncChromeApi.setStorage({
        'TiStatus': {
            'everInstalled': true
        }
    });

    if(!await tiHelper.getIfShowTutorial('', true)) {
        UtilCarbonCommon_api.logError("Failed to get if show pg tutorial from Titanium");
    }

    if(!await tiHelper.getSettings()) {
        UtilCarbonCommon_api.logError("Failed to get settings from Titanium");
    }

    if(!await tiHelper.getExceptionList()) {
        UtilCarbonCommon_api.logError("Failed to get exception list from Titanium");
    }

    if(!await tiHelper.getSerialNumber()) {
        UtilCarbonCommon_api.logError("Failed to get serail number from Titanium");
    }

    return true;
}

