async function onStartup()
{
    await AsyncChromeApi.setStorage({
        'framework_status': false, 
        'wtp_rating_result': WRS_RATING_LEVEL.Safe
    });

    let productInfo = await UtilProductInfo.setProductInfo();
    
    await setLanguage();
    await setL10nString();
    await utilBrowserIcon.setBadgeColor();
    await utilPwM.setPwMstatus();
    await UtilAkamai.getServerConfig();
    
    let localStorageCacheData = UtilLocalStorageCache.getValue({
        'mode': '',
        'os': '',
        'welcomePage': false,
        'license': {}
    });
    
    let connectRet = false;
    if (UtilPlatform.isWindows()) {
        connectRet = await connectTitanium();
    }
    UtilCarbonCommon_api.logInfo(initializator_tagName, 'onStartup: connectRet = ' + connectRet);

    if (connectRet) {
        let helper = ProductBundle.getProductHelper();
        if (helper && helper.license.IsEOS) {
            connectRet = false;
            helper.disconnect();

            if (localStorageCacheData.mode === CARBON_MODE.STANDALONE) {
                let oldLicense = (await AsyncChromeApi.getStorage({
                    'old_license': {}
                })).old_license;

                let cacheLicenseData = UtilLocalStorageCache.getValue('license');
                await AsyncChromeApi.setStorage({
                    'license': oldLicense,
                    'old_license': cacheLicenseData
                });
            }
        }
    }
    
    let newCarbonMode = '';
    let newStorageData = {};
    if (!connectRet) {
        newCarbonMode = UtilProductInfo.getMode(localStorageCacheData.os, _locale);
        if (newCarbonMode === localStorageCacheData.mode && newCarbonMode === CARBON_MODE.STANDALONE) {
            let cacheLicenseData = UtilLocalStorageCache.getValue('license');
            // Enable WTP when license is valid in standalone mode.
            if (cacheLicenseData.FeatureToggle && cacheLicenseData.FeatureToggle.WTP) {
                newStorageData['wtp_status'] = true;
            }
        }

        newStorageData['browser_status'] = '';
    }
    else {
        newCarbonMode = CARBON_MODE.COEXIST;
    }
    UtilCarbonCommon_api.logInfo('initial: newCarbonMode = ' + newCarbonMode);

    if (newCarbonMode !== localStorageCacheData.mode) {
        if (newCarbonMode === CARBON_MODE.STANDALONE) {
            await src.reset();
            if (localStorageCacheData.mode === CARBON_MODE.COEXIST) {
                ProductBundle.getProductHelper().saveExceptionList();
                newStorageData['iconchange'] = 2;
            }
        }
        else if (newCarbonMode === CARBON_MODE.PROMOTER) {
            await src.reset();
        }
        else if(newCarbonMode === CARBON_MODE.COEXIST) {
            if(UtilPlatform.isWindows()) {
                let helper = ProductBundle.getTitaniumHelper();
                helper.notifyStatusChanged();
            }

            newStorageData["welcome"] = true;
            if ('firefox' !== initializator_browserId) {
                newStorageData["eula"] = true;
            }
        }
    }
    await setUrlsToStorage();

    if(newCarbonMode === CARBON_MODE.COEXIST) {
        newStorageData["pum_status"] = true;
    }
    
    newStorageData['mode'] = newCarbonMode;
    newStorageData['framework_status'] = true;

    // open Sign-In page when welcome was open and token expired
    if (localStorageCacheData.welcomePage && localStorageCacheData.license.refreshTokenExpired) {
        src.onRefreshTokenExpired();
    }
    UtilCarbonCommon_api.logInfo('initial: newStorageData = ' + JSON.stringify(newStorageData));
    await AsyncChromeApi.setStorage(newStorageData);

    // Setup uninstall survey
    let uninstallSurveyUrl = '';
    if (newCarbonMode === CARBON_MODE.COEXIST && ProductBundle.getProductHelper().isNTT()) {
        uninstallSurveyUrl = '';
    }
    else if (_l10n === 'en') {
        uninstallSurveyUrl = (await AsyncChromeApi.getStorage({
            'urls': {}
        })).urls.uninstall_survey || '';
        if(uninstallSurveyUrl.length !== 0) {
            uninstallSurveyUrl += '&sguid=' + productInfo.tiguid;
        }
    }
    else if (_l10n === 'ja') {
        uninstallSurveyUrl = (await AsyncChromeApi.getStorage({
            'urls': {}
        })).urls.uninstall_survey || '';
        if(uninstallSurveyUrl.length !== 0) {
            uninstallSurveyUrl += '&id=' + productInfo.tiguid;
        }
    }
    UtilCarbonCommon_api.logInfo('uninstallSurveyUrl = ' + uninstallSurveyUrl);
    initializator_browser.runtime.setUninstallURL(uninstallSurveyUrl);
}

