const mbe_tagName = '[mbe]';
const mbe_browser = UtilCarbonCommon_api.getBrowser();

async function loadPattern()
{
    let pattern = null;
    try {
        const response = await fetch(mbe_browser.runtime.getURL("js/mbe/pattern.json"));
        pattern = await response.json();
    } catch(e) {
        UtilCarbonCommon_api.logError(mbe_tagName, 'loadPattern: e = ' + e);
    }

    return pattern;
}

async function checkMaliciousBrowserExtension()
{
    let pattern = await loadPattern();
    if (!pattern || pattern.length === 0) {
        return;
    }

    let extensionList = await mbe_browser.management.getAll();
    for(let extension of extensionList) {
        let index = UtilCarbonCommon_api.binarySearch(pattern, extension.id, 0, pattern.length-1);
        if (index === -1) {
            continue;
        }

        UtilCarbonCommon_api.logInfo(mbe_tagName, 'checkMaliciousBrowserExtension: mbe is detected...id = ' + extension.id);
        UtilTelemetryCollector.addTcEvent(constants_UBM_ID.MBE_DETECTION, {
            'id': extension.id,
            'name': extension.name,
            'version': extension.version,
            'enabled': extension.enabled,
            'mayDisable': extension.mayDisable
        });
    }
}

async function mbe_onInstalledHandler()
{
    await checkMaliciousBrowserExtension();
}

async function mbe_onStartupHandler()
{
    await checkMaliciousBrowserExtension();
}

