function onFrameworkStatusReady()
{
    let localStroageCacheData = UtilLocalStorageCache.getValue({
        'welcomePage': false,
        'eula': false,
        'mode': '',
        'license': {}
    });

    if (localStroageCacheData.mode === CARBON_MODE.STANDALONE) {
        if (!localStroageCacheData.welcomePage) {
            showLoginPage()
            .then(async () => {
                await setStorageWelcomePage();
            });
        }
    }
    else if (localStroageCacheData.mode === CARBON_MODE.COEXIST) {
        if (!localStroageCacheData.welcomePage || (!localStroageCacheData.eula && 'firefox' === service_worker_browserId)) {
            let welcomePageUrl = service_worker_browser.runtime.getURL("js/common/welcome.html?type=" + getWelcomePageType());
            service_worker_browser.tabs.create({
            'url': welcomePageUrl
            }, async () => {
                await setStorageWelcomePage();
                await closeStorePageInSingleWindowBrowser();
                await closeInstallToolbarPage();
            });
        }
    }
    else if (localStroageCacheData.mode === CARBON_MODE.PROMOTER) {
        if (!localStroageCacheData.welcomePage || (!localStroageCacheData.eula && 'firefox' === service_worker_browserId)) {
            let welcomePageUrl = service_worker_browser.runtime.getURL("js/common/welcome.html?type=" + getWelcomePageType());
            service_worker_browser.tabs.create({
            'url': welcomePageUrl
            }, async () => {
                await setStorageWelcomePage();
            });
        }
    }

    let ubmEventId = constants_UBM_ID.FRAMEWORK_READY;
    let ubmParam = {
        'browser_id': service_worker_browserId,
        'mode': localStroageCacheData.mode,
        'bundled_product_version': ''
    }
    if(localStroageCacheData.mode === CARBON_MODE.COEXIST) {
        ubmParam.bundled_product_version = ProductBundle.getProductHelper().productInfo.ProductVersion;
    }
    if(localStroageCacheData.license.SKU === 'E') {
        ubmParam.mode += '-E'
    }

    UtilTelemetryCollector.addTcEvent(ubmEventId, ubmParam);

    // TI-13445 Please help to uninstall beta FFToolbar when user install prod FFToolbar successfully
    if(localStroageCacheData.mode === CARBON_MODE.COEXIST &&
       service_worker_browserId === 'firefox' &&
       service_worker_browser.runtime.id === ProdFirefoxToolbarId) {
        checkBetaFirefox();
    }
}

async function onRuntimeInstalled(details)
{
    try {
        if (!initializator.isInitialized()) {
            setTimeout(() => {
                onRuntimeInstalled(details);
            }, 500)
            return;
        }
    
        if (details.reason == "install") {
            await UtilAkamai.initialServerConfig();
            // This event may happened after Carbon is running
            UtilTelemetryCollector.addTcEvent(constants_UBM_ID.INSTALL, '1');
        }
        else if (details.reason == "update") {
            // Check if token is existed in Standalone
            await checkTokenWhenUpdate();
            await initializator.setUrlsToStorage();
    
            UtilTelemetryCollector.addTcEvent(constants_UBM_ID.UPDATE, '1');
        }
 
        await initializator.onStartup();
        StatusCtrl.onInstalledHandler(details);
        adblock_background.onInstalledHandler(details);
        mbe.onInstalledHandler(details);
    } catch(exception) {
        UtilCarbonCommon_api.logError('onRuntimeInstalled: exception = ' + exception);
    }
}

async function onRuntimeStartup()
{
    try {
        if (!initializator.isInitialized()) {
            setTimeout(() => {
                onRuntimeStartup();
            }, 500);
            return;
        }

        let tabs = await service_worker_browser.tabs.query({});
        if (tabs.length === 0) {
            // Wait for tabs is created
            setTimeout(() => {
                onRuntimeStartup();
            }, 1000);
            return;
        }

        await initializator.onStartup();
        StatusCtrl.onStartupHandler();
        background.onStartupHandler();
        await PayGuard_background.onStartupHandler();
        src_background.onStartupHandler();
        PrivacyScanner.onStartupHandler();
        await mbe.onStartupHandler();
        await src.onStartupHandler();
    } catch(exception) {
        UtilCarbonCommon_api.logError('onRuntimeStartup: exception = ' + exception);
    }
}

