async function showNotification(contentType)
{
    let activeTabs = await AsyncChromeApi.getActiveTab();
    UtilCarbonCommon_api.logInfo('showNotification: activeTabs = ', activeTabs);
    if (activeTabs.length === 0) {
        UtilTelemetryCollector.addTcEvent(constants_UBM_ID.NOTIFICATION_SENDMESSAGE_ERROR, JSON.stringify({
            'content': contentType
        }));
        return;
    }
    
    service_worker_browser.tabs.sendMessage(activeTabs[0].id,{
        'action': TB_ACTIONS.SHOW_NOTIFICSTION,
        'parameters': {
            'content': contentType
        }
    }, () => {
        if(service_worker_browser.runtime.lastError) {
            UtilCarbonCommon_api.logInfo('showNotification: sendMessage failed!...error = ' + service_worker_browser.runtime.lastError.message);
            UtilTelemetryCollector.addTcEvent(constants_UBM_ID.NOTIFICATION_SENDMESSAGE_ERROR, JSON.stringify({
                'content': contentType,
                'tabURL': activeTabs[0].url
            }));
        }
    });
}

function closeSyncTab(tabId, notificationContentType, startTime, showMessageTime)
{
    UtilCarbonCommon_api.logInfo(`closeSyncTab: tabId = ${tabId}`);

    const checkShowTime = () => {
        let currentTime = Date.now();
        if (currentTime < startTime || showMessageTime > currentTime - startTime) {
            return false;
        }

        service_worker_browser.tabs.get(tabId, () => {
            let ubmValue = {
                'diffTime': -1,
                'type': notificationContentType
            };

            if (service_worker_browser.runtime.lastError) {
                UtilCarbonCommon_api.logError('closeSyncTab: sender tab is not existed');
                showNotification(notificationContentType);
            } else {
                // Tab exists
                ubmValue.diffTime = currentTime - startTime;
                service_worker_browser.tabs.remove(tabId, () => {
                    showNotification(notificationContentType);
                });
            }

            UtilTelemetryCollector.addTcEvent(constants_UBM_ID.TI_CLOSE_SYNC_PAGE, JSON.stringify(ubmValue));
        });

        return true;
    }
    if (!checkShowTime()) {
        let itvCheckShowMessageTime = setInterval(() => {
            if (checkShowTime()) {
                clearInterval(itvCheckShowMessageTime);
            }
        }, 500);
    }
}

async function onGetSettingsFromTi(request, sender)
{
    const minShowMessageTime = 5000;
    let ret = false;
    try {
        do {
            let helper = ProductBundle.getProductHelper();
            if (!helper) {
                UtilCarbonCommon_api.logError('onGetSettingsFromTi: unable to get product helper');
                break;
            }
            ret = await helper.getSettings();
            UtilCarbonCommon_api.logInfo(`onGetSettingsFromTi: ret = ${ret}`);
    
            if (sender.tab) {
                let startTime = request.params.hasOwnProperty('StartTime') ? request.params.StartTime : Date.now();
                let notificationContentType = request.params.hasOwnProperty('ContentType') ? request.params.ContentType : NOTIFICATION_CONTENT_TYPE.NOTIFY_CHANGE_SETTINGS;
                let showMessageTime = request.params.hasOwnProperty('ShowMessageTime') ? request.params.ShowMessageTime : minShowMessageTime;
                closeSyncTab(sender.tab.id, notificationContentType, startTime, showMessageTime);
            }
            else {
                UtilCarbonCommon_api.logError('onGetSettingsFromTi: unable to get tab id');
            }
        } while(false);
    } catch(exception) {
        UtilCarbonCommon_api.logError(`onGetSettingsFromTi: exception = ${exception}`);
        ret = false;
    }

    return ret;
}

function onRuntimeMessage(request, sender, sendResponse)
{
    try {
        if (!request ||
            !request.hasOwnProperty('action')) {
            UtilCarbonCommon_api.logInfo('onRuntimeMessage: no action in request...request = ' + JSON.stringify(request));
            return;
        }
        else if (!initializator.isInitialized() || !checkFrameworkStatus()) {
            setTimeout(() => {
                onRuntimeMessage(request, sender, sendResponse);
            }, 500)
            return true;
        }
    
        let handler = UtilMessageHandler.runtime.getHandler(request.action);
        if(!handler) {
            UtilCarbonCommon_api.logInfo('onRuntimeMessage: no handler...action = ' + request.action);
            return;
        }
        else if (typeof(handler) !== 'function') {
            UtilCarbonCommon_api.logError('onRuntimeMessage: invalid hanler');
            return;
        }
        UtilCarbonCommon_api.logInfo('onRuntimeMessage: action = ' + request.action);
    
        let ret = handler(request, sender);
        if (typeof(ret) === 'object' && typeof(ret.then) === 'function') {
            ret.then(response => {
                sendResponse(response);
            });
            return true;
        }
        else if (typeof(ret) === 'undefined') {
            sendResponse({});
        }
        else {
            sendResponse(ret);
        }
    } catch(exception) {
        UtilCarbonCommon_api.logError('onRuntimeMessage: exception = ' + exception);
    }
}

