async function onLocalStorageChanged(changes)
{
    UtilLocalStorageCache.update(changes);

    // Update icon when some data is updated
    let bUpdateIcon = false;
    const updateIconKeyList = [
        'mode',
        'eula',
        'framework_status',
        'welcomePage',
        'wtp_status',
        'ads_status',
        'ads_on_current_website',
        'titanium',
        'itis'
    ];

    if (changes.hasOwnProperty('license') &&
        StatusCtrl.isLicenseStatusChanged(changes['license'].oldValue, changes['license'].newValue)) {
        bUpdateIcon = true;
    }
    else {
        for (let key of updateIconKeyList) {
            if (changes.hasOwnProperty(key) && changes[key].oldValue !== changes[key].newValue) {
                bUpdateIcon = true;
                break;
            }
        }
    }

    if ((changes.hasOwnProperty('locale_n_region') && changes['locale_n_region'].oldValue !== changes['locale_n_region'].newValue)
    || changes.hasOwnProperty('mode')) {
        await initializator.setUrlsToStorage();
    }

    if (changes.hasOwnProperty('framework_status') && changes['framework_status'].newValue) {
        onFrameworkStatusReady();
    }

    if (bUpdateIcon) {
        utilBrowserIcon.UpdateBrowserActionIcon();
    }

    background.onStorageChangedHandler(changes);
    adblock_background.onStorageChangedHandler(changes);
}

