async function onActionClickedCoexist()
{
    const localStorageCacheData = UtilLocalStorageCache.getValue({
        'eula': false,
        'welcomePage': false,
        'framework_status': false,
        'license': {}
    });

    let showWelcomePage = false;
    if (!localStorageCacheData.framework_status) {
        showWelcomePage = false;
    }
    else if (!localStorageCacheData.welcomePage) {
        showWelcomePage = true;
    }
    else if (!localStorageCacheData.eula && 'firefox' === service_worker_browserId) {
        showWelcomePage = true;
    }
    else {
        showWelcomePage = false;
    }

    if (showWelcomePage) {
        const welcomePageUrl = service_worker_browser.runtime.getURL("js/common/welcome.html?type=init");
        service_worker_browser.tabs.query({
            'url': welcomePageUrl
        }, (tabList) => {
            if (tabList.length > 0) {
                UtilCarbonCommon_api.logInfo('welcome page is opened, focus on it');
                service_worker_browser.tabs.update(tabList[0].id, { active: true }, function () {
                    service_worker_browser.windows.update(tabList[0].windowId, { focused: true });
                });
                return;
            }

            service_worker_browser.tabs.create({
                'url': welcomePageUrl
            }, () => {
                AsyncChromeApi.setStorage({
                    'welcomePage': true
                });
            });
        });
    }
}

