function exec() 
{
    // Initial message map
    UtilMessageHandler.runtime.AddHandler(TB_ACTIONS.INJECTRESOURCES, onInjectResources);
    UtilMessageHandler.runtime.AddHandler(TB_ACTIONS.FEED_UBM, onFeedUbm);
    UtilMessageHandler.runtime.AddHandler(TB_ACTIONS.OPEN_TI_WTP_EXCEPTION_PAGE, onOpenTiWtpExceptionPage);
    UtilMessageHandler.runtime.AddHandler(TB_ACTIONS.GET_PRODUCT_SETTINGS, onGetProductSettings);
    UtilMessageHandler.runtime.AddHandler(TB_ACTIONS.OPEN_SETTINGS, onOpenSettings);
    UtilMessageHandler.runtime.AddHandler(TB_ACTIONS.OPEN_HELP, onOpenHelp);
    UtilMessageHandler.runtime.AddHandler(TB_ACTIONS.UPDATE_INIT_STORAGE, onUpdateInitStorage);
    UtilMessageHandler.runtime.AddHandler(TB_ACTIONS.GET_SETTINGS_FROM_TI, onGetSettingsFromTi);
    UtilMessageHandler.runtime.AddHandler(TB_ACTIONS.OPEN_LOGIN_PAGE, onOpenLoginPage);

    service_worker_browser.runtime.onInstalled.addListener(onRuntimeInstalled);
    service_worker_browser.runtime.onStartup.addListener(onRuntimeStartup);
    service_worker_browser.runtime.onMessage.addListener(onRuntimeMessage);
    service_worker_browser.runtime.onConnect.addListener(onRuntimeConnect);

    service_worker_browser.storage.onChanged.addListener(onLocalStorageChanged);

    service_worker_browser.tabs.onCreated.addListener(onTabsCreated);
    service_worker_browser.tabs.onUpdated.addListener(onTabsUpdated);
    service_worker_browser.tabs.onActivated.addListener(onTabsActivated);
    service_worker_browser.tabs.onRemoved.addListener(onTabsRemoved);

    service_worker_browser.management.onEnabled.addListener(onManagementEnabled);

    service_worker_browser.action.onClicked.addListener(onActionClicked);

    service_worker_browser.windows.onRemoved.addListener(onWindowsRemoved);
    // add listener for windows bounds changed if it is supported (Firefox does not support it)
    if (!!service_worker_browser.windows.onBoundsChanged) {
        service_worker_browser.windows.onBoundsChanged.addListener(onWindowsBoundsChanged);
    }

    initializator.initialize();
}
exec();
